앞서 변수 캡쳐링에 대해 언급했던 부분을 기억하나요?
setTimout에 전달하는 모든 함수 표현식은 사실 같은 스코프에서 같은 i를 참조합니다.
잠시, 이게 무슨 뜻인지 생각해 보세요.
setTimeout은 함수를 몇 밀리 초 후에 실행 시키겠지만. 항상for루프가 실행을 멈추고 난 뒤에 실행됩니다.
for 루프가 실행을 중지했을 때, i의 값은 10입니다.
따라서 매번 주어진 함수가 호출될 때마다 10을 출력할 것입니다.
일반적으로 이를 동작하게 하는 방법은 즉시 실행 함수(IIFE - an Immediately Invoked Function Expression)를 사용해 매 반복마다 i를 잡아두는 것입니다:
for (var i = 0; i 
이런 이상해 보이는 패턴이 사실 일반적인 패턴입니다.
매개변수에 i가 for 루프의 i를 감춰 버립니다. 하지만 이름을 같게 했기 때문에 루프의 실행 부를 크게 수정할 필요가 없습니다.
let 선언 (let declarations)
이제, var에  몇 가지 문제점에 대해 알게 되었는데, 이런 이유 때문에 let을 도입하게 되었습니다.
사용되는 키워드를 빼고는 let 문은 var와 동일한 방법으로 작성됩니다.
let hello = "Hello!";

주요한 차이점은 구문 보단 의미에 있는데, 이제 이 내용을 살펴볼 것입니다.
블록 스코프 (Block-scoping)
변수가 let을 이용해 선언되었을 때, 이는 렉시컬 스코핑(lexical-scoping) 혹은 블록 스코핑(block-scoping) 이라 불리는 것을 사용합니다.
var로 선언된 변수가 이를 포함한 함수까지 흘러나오는 것과 달리, 블록-스코프 변수들은 이를 가장 가깝게 감싸고 있는 블록 혹은 for-루프 밖에서 접근할 수 없습니다.
function f(input: boolean) {
    let a = 100;

    if (input) {
        // 'a'를 참조할 수 있습니다.
        let b = a + 1;
        return b;
    }

    // 오류: 'b'는 여기서 존재하지 않습니다.
    return b;
}

여기, 두 지역 변수 a와 b가 있습니다.
a의 스코프는 f의 블록으로 한정되지만, b는 이를 감싸고 있는 if문의 블록까지로 한정됩니다.
catch 문에 선언된 변수 또한 비슷한 스코프 규칙을 가집니다.
try {
    throw "oh no!";
}
catch (e) {
    console.log("Oh well.");
}

// 오류: 'e'는 여기서 존재하지 않습니다.
console.log(e);

또 다른 블록-스코프 변수의 특징은 변수들이 선언되기 전에 읽거나, 쓰는 것이 불가능하다는 것입니다.
이 변수들은 스코프에 걸쳐 "존재"하지만, 선언되는 부분 전까지 모든 부분들이 temploral dead zone입니다.
이것은 let문 이전에 변수들에 접근할 수 없다는 정교한 방식이며, 다행히 TypeScript가 알려줍니다.
a++; // `a`가 선언되기 전에 잘못된 사용.
let a;

주의할 점은 여전히 선언되기 전에 블록-스코프 변수를 잡아둘 수 있다는 것입니다.
선언되기 전에 함수를 실행하는 것이 안된 다는 것만 알아두면 됩니다.
ES2015를 대상으로한, 최신 런타임은 오류를 던질 것입니다; 하지만 현재 TypeScript에서는 허용되며, 오류를 보고하지 않습니다.
function foo() {
    // 'a' 캡처는 성공
    return a;
}

// `a`가 선언되기 전에 `foo` 를 호출
// 런타임에 오류를 던질 것 입니다.
foo();

let a;

temporal dead zone에 더 자세한 설명은 Mozilla Developer Network를 살펴보세요.
재선언과 쉐도잉 (Re-declarations and Shadowing)
var로 선언하면 얼마나 변수를 많이 선언하는지는 중요하지 않다고 했습니다. 단 하나만 생성됩니다.
function f(x) {
    var x;
    var x;

    if (true) {
        var x;
    }
}

위 예제를 보면 모든 x의 선언은 사실 같은 x를 가르치며, 이는 유효합니다.
이건 종종 버그의 원인이 됩니다.
고맙게도, let선언은 이것을 허용하지 않습니다.
let x = 10;
let x = 20; // 오류: 'x'를 같은 스코프에 선언할 수 없습니다.

TypeScript가 문제를 알려주기 때문에, 변수를 반드시 블록 범위로 지정할 필요는 없습니다.
function f(x) {
    let x = 100; // 오류: 매개 변수 선언을 방해합니다.
}

function g() {
    let x = 100;
    var x = 100; // 오류: `x`를 중복해서 선언할 수 없습니다.
}

블록-스코프 변수가 함수-스코프 변수로 선언될 수 없다는 것은 아닙니다.
블록 스코프 변수는 단지 별개의 다른 블록에 선언되어야 합니다.
function f(condition, x) {
    if (condition) {
        let x = 100;
        return x;
    }

    return x;
}

f(false, 0); // '0' 반환
f(true, 0);  // '100' 반환

더 중첩된 스코프에서 바깥 스코프의 변수 이름을 사용하는 것을 shadowing이라고 합니다.
shadowing은 양날의 검이라고 할 수 있는데, 이는 실수로 방생되어 특정 버그를 일으키거나, 혹은 특정 버그를 막기 위해 쓰이기 때문입니다.
예를 들어, 위에서 사용했던 sumMatrix 함수를 let 을 이용해서 작성했다고 생각해 봅시다.
function sumMatrix(matrix: number[][]) {
    let sum = 0;
    for (let i = 0; i 
이 루프는 합을 올바르게 계산할 것입니다. 왜냐하면 안쪽 루프의 i 가 바깥 루프의 i를 가리기 때문입니다.
보통 더 명확한 코드 작성을 위해 shadowing 사용을 피합니다.
하지만 shadowing의 이점을 활용할 수 있는 적합한 상황이 있으므로, 최선의 판단을 내려야 합니다.
블록 스코프 변수 캡쳐링 (Block-scoped variable capturing)
var 선언에 변수 캡쳐링을 하는 것을 처음 보았을 때, 변수가 한번 캡쳐되면 어떻게 동작하는지 간단히 살펴보았습니다.
이를 더 잘 이해해 보면, 스코프가 각각 실행될 때마다 변수의 "환경"을 만듭니다.
변수의 환경과 캡쳐된 변수들은 심지어 스코프가 포함한 모든 것이 실행을 종료한 후에도 존재합니다.
function theCityThatAlwaysSleeps() {
    let getCity;

    if (true) {
        let city = "Seattle";
        getCity = function() {
            return city;
        }
    }

    return getCity();
}

city를 해당 환경 안에 캡쳐했기 때문에, if 블록의 실행이 완료되었음에도 여전히 city에 접근할 수 있습니다.
앞의 setTimeout 예제에서, for 루프가 매번 반복될 때마다 변수를 캡쳐하기 위해서 IIFE를 사용했던 것을 떠올려 봅시다.
실제론, 캡처된 변수를 위해 새로운 변수 환경을 만드는 것이었습니다.
이는 약간의 고통스러운 일이지만, 다행히, 타입스크립트 에서는 그렇게 할필요가 없습니다.
let 선언은 루프의 일부로 선언될 때 동작이 크게 다릅니다.
이 선언은 루프 자체에 새로운 환경을 만드는 대신, 반복마다 새로운 환경을 만들어 냅니다.
