소개 (Introduction)
↥ 위로
JSX는 내장형 XML 같은 구문입니다.
변환의 의미는 구현에 따라 다르지만 유효한 JavaScript로 변환되어야 합니다.
JSX는 React로 큰 인기를 얻었지만, 이후 다른 구현도 등장했습니다.
TypeScript는 임베딩, 타입 검사, JSX를 JavaScript로 직접 컴파일하는 것을 지원합니다.
기본 사용법 (Basic usage)
↥ 위로
JSX를 사용하려면 다음 두 가지 작업을 해야 합니다.

파일 이름을 .tsx 확장자로 지정합니다.
jsx 옵션을 활성화합니다.

TypeScript는 preserve, react 및 react-native라는 세 가지의 JSX 모드와 함께 제공됩니다.
이 모드들은 방출 단계에서만 영향을 미치며, 타입 검사에는 영향을 받지 않습니다.
preserve 모드는 다른 변환 단계(예: Babel)에 사용하도록 결과물의 일부를 유지합니다.
또한 결과물은 .jsx 파일 확장자를 갖습니다.
react 모드는 React.createElement를 생성하여, 사용하기 전에 JSX 변환이 필요하지 않으며, 결과물은 .js 확장자를 갖게 됩니다.
react-native 모드는 JSX를 유지한다는 점은 preserve 모드와 동일하지만, 결과물은 .js 확장자를 갖게 된다는 점이 다릅니다.



