as 연산자 (The as operator)
↥ 위로
타입 단언(type assertion)을 어떻게 작성하는지 떠올려 볼까요:
var foo = bar;

위 코드는 변수 bar가 foo 타입이라는 것을 단언합니다.
TypeScript는 꺾쇠 괄호를 사용해 타입을 단언하기 때문에, JSX 구문과 함께 사용할 경우 특정 문법 해석에 문제가 될 수도 있습니다. 결과적으로 TypeScript는 .tsx 파일에서 화살 괄호를 통한 타입 단언을 허용하지 않습니다.
위의 구문은 .tsx 파일에서 사용할 수 없으므로, as라는 대체 연산자를 통해 타입 단언을 해야 합니다.
위의 예시는 as 연산자로 쉽게 다시 작성할 수 있습니다.
var foo = bar as foo;

as 연산자는 .ts와 .tsx 파일 모두 사용할 수 있으며, 꺾쇠 괄호 형식의 단언과 동일하게 동작합니다.
타입 검사 (Type Checking)
↥ 위로
JSX의 타입 검사를 이해하기 위해선, 먼저 내장 요소와 값-기반 요소의 차이점에 대해 알아야 합니다.
JSX 표현식 에서 expr은 환경에 내장된 요소(예: DOM 환경의 div 또는 span) 혹은 사용자가 만든 사용자 정의 컴포넌트를 참조할 것입니다.
이는 다음과 같은 두 가지 이유로 중요합니다:

리액트에서 내장 요소는 React.createElement("div")과 같은 문자열로 생성되는 반면, 사용자가 만든 컴포넌트는 React.createElement("MyComponent")가 아닙니다.
JSX 요소에 전달되는 속성의 타입은 다르게 조회되어야 합니다.
내장 요소의 속성은 내재적으로 알고 있어야 하지만, 컴포넌트는 각각 자신의 속성 집합을 지정하려고 합니다.

TypeScript는 React와 동일한 규칙을 사용하여 구별합니다.
내장 요소는 항상 소문자로 시작하고 값-기반 요소는 항상 대문자로 시작합니다.
내장 요소 (Intrinsic elements)
↥ 위로
내장 요소는 특수 인터페이스 JSX.IntrinsicElements에서 조회됩니다.
기본적으로 이 인터페이스가 지정되지 않으면 그대로 진행되어 내장 요소 타입은 검사되지 않습니다.
그러나 이 인터페이스가 있는 경우, 내장 요소의 이름은 JSX.IntrinsicElements 인터페이스의 프로퍼티로 조회됩니다.
예를 들어:
declare namespace JSX {
    interface IntrinsicElements {
        foo: any
    }
}

; // 성공
; // 오류

위의 예제에서 는 잘 동작하지만, 는 JSX.IntrinsicElements에 지정되지 않았기 때문에 오류를 일으킵니다.

참고: 다음과 같이 JSX.IntrinsicElements에 catch-all 문자열 인덱서를 지정할 수도 있습니다.

declare namespace JSX {
    interface IntrinsicElements {
        [elemName: string]: any;
    }
}

값-기반 요소 (Value-based elements)
↥ 위로
값-기반 요소는 해당 스코프에 있는 식별자로 간단하게 조회됩니다.
import MyComponent from "./myComponent";

; // 성공
; // 오류

값-기반 요소를 정의하는데엔 다음의 두 가지 방법이 있습니다:

함수형 컴포넌트 (FC)
클래스형 컴포넌트

이 두 가지 유형의 값-기반 요소는 JSX 표현식에서 서로 구별할 수 없으므로, TS는 과부하 해결을 사용하여 먼저 함수형 컴포넌트 표현식으로 해석합니다. 이 과정이 성공적으로 진행되면, TS는 이 선언을 표현식으로 해석합니다. 함수형 컴포넌트로 해석되지 않는다면, TS는 클래스형 컴포넌트로 해석을 시도합니다. 이 과정도 실패할 경우, TS는 오류를 보고합니다.
함수형 컴포넌트 (Function Component)
↥ 위로
이름에서 알 수 있듯, 컴포넌트는 첫 번째 인수가 props 객체인 JavaScript 함수로 정의됩니다.
TS는 컴포넌트의 반환 타입이 JSX.Element에 할당 가능하도록 요구합니다.
interface FooProp {
  name: string;
  X: number;
  Y: number;
}

declare function AnotherComponent(prop: {name: string});
function ComponentFoo(prop: FooProp) {
  return ;
}

const Button = (prop: {value: string}, context: { color: string }) => 

함수형 컴포넌트는 JavaScript 함수이므로, 함수 오버로드 또한 사용 가능합니다:
interface ClickableProps {
  children: JSX.Element[] | JSX.Element
}

interface HomeProps extends ClickableProps {
  home: JSX.Element;
}

interface SideProps extends ClickableProps {
  side: JSX.Element | string;
}

function MainButton(prop: HomeProps): JSX.Element;
function MainButton(prop: SideProps): JSX.Element {
  ...
}


참고: 함수형 컴포넌트는 이전에 무상태 함수형 컴포넌트(SFC)로 알려져 있습니다. 하지만 최근 버전의 리액트에선 더 이상 함수형 컴포넌트를 무상태로 취급하지 않으며, SFC 타입과 그 별칭인 StatelessComponent은 더 이상 사용되지 않습니다.

클래스형 컴포넌트 (Class Component)
↥ 위로
클래스형 컴포넌트의 타입을 정의하는 것은 가능합니다.
이를 위해선 요소 클래스 타입 과 요소 인스턴스 타입 이라는 새로운 용어를 이해해야 합니다.
에서, 요소 클래스 타입 은 Expr의 타입입니다.
위의 예시에서 MyComponent가 ES6 클래스라면 이 클래스 타입은 클래스 생성자이고 전역입니다.
MyComponent가 팩토리 함수라면, 클래스 타입은 해당 함수입니다.
클래스 타입이 결정되면, 인스턴스 타입은 클래스 타입의 생성자 혹은 호출 시그니처(있는 것 중 어느 쪽으로든)에 의한 반환 타입을 결합하여 결정됩니다.
따라서 ES6 클래스의 경우, 인스턴스 타입은 해당 클래스의 인스턴스 타입이 되고, 팩토리 함수의 경우엔 해당 함수로부터 반환된 값의 타입이 됩니다.
class MyComponent {
  render() {}
}

// 생성자 시그니처 사용
var myComponent = new MyComponent();

// 요소 클래스 타입 => MyComponent
// 요소 인스턴스 타입 => { render: () => void }

function MyFactoryFunction() {
  return {
    render: () => {
    }
  }
}

// 호출 시그니처 사용
var myComponent = MyFactoryFunction();

// 요소 클래스 타입 => MyFactoryFunction
// 요소 인스턴스 타입 => { render: () => void }

흥미롭게도 요소 인스턴스 타입은 JSX.ElementClass에 할당 가능해야 하며, 그렇지 않을 경우 오류를 일으킵니다.
기본적으로 JSX.ElementClass는 {}이지만, 적절한 인터페이스에 적합한 타입으로만 JSX를 사용하도록 제한할 수 있습니다.
declare namespace JSX {
  interface ElementClass {
    render: any;
  }
}

class MyComponent {
  render() {}
}
function MyFactoryFunction() {
  return { render: () => {} }
}

; // 성공
; // 성공

class NotAValidComponent {}
function NotAValidFactoryFunction() {
  return {};
}

; // 오류
; // 오류

속성 타입 검사 (Attribute type checking)
↥ 위로
속성 타입 검사를 위해선 첫 번째로 요소 속성 타입 을 결정해야 합니다.
이는 내장 요소와 값-기반 요소 간에 약간 다른 점이 있습니다.
내장 요소의 경우, 요소 속성 타입은 JSX.IntrinsicElements의 프로퍼티 타입과 동일합니다.
declare namespace JSX {
  interface IntrinsicElements {
    foo: { bar?: boolean }
  }
}

// 'foo'의 요소 속성 타입은 '{bar?: boolean}'
;

값-기반 요소의 경우엔 조금 더 복잡합니다.
이전에 요소 인스턴스 타입 의 프로퍼티 타입에 따라 결정됩니다.
사용할 프로퍼티는 JSX.ElementAttributesProperty에 따라 결정됩니다.
이는 단일 프로퍼티로 선언되어야 합니다.
이후 해당 프로퍼티 이름을 사용합니다.
TypeScript 2.8 부터 JSX.ElementAttributesProperty가 제공되지 않으면, 클래스 요소의 생성자 또는 함수형 컴포넌트의 첫 번째 매개변수 타입을 대신 사용할 수 있습니다.
declare namespace JSX {
  interface ElementAttributesProperty {
    props; // 사용할 프로퍼티 이름을 지정
  }
}

class MyComponent {
  // 요소 인스턴스 타입의 프로퍼티를 지정
  props: {
    foo?: string;
  }
}

// 'MyComponent'의 요소 속성 타입은 '{foo?: string}'


요소 속성 타입은 JSX에서 속성 타입을 확인하는데 사용됩니다.
선택적 혹은 필수적인 프로퍼티들이 지원됩니다.
declare namespace JSX {
  interface IntrinsicElements {
    foo: { requiredProp: string; optionalProp?: number }
  }
}

; // 성공
; // 성공
; // 오류, requiredProp이 누락됨
; // 오류, requiredProp은 문자열이어야 함
; // 오류, unknownProp은 존재하지 않음
; // 성공, 'some-unknown-prop'은 유효한 식별자가 아니기 때문에


참고: 만약 속성 이름이 유효한 JavaScript 식별자(data-* 속성 등)가 아닌 경우, 해당 이름을 요소 속성 타입에서 찾을 수 없어도 오류로 간주하지 않습니다.

추가적으로, JSX.IntrinsicAttributes 인터페이스는 일반적으로 컴포넌트의 props나 인수로 사용되지 않는 JSX 프레임워크를 위한 추가적인 프로퍼티를 지정할 수 있습니다. - 예를 들면 React의 key. 더 나아가서, JSX.IntrinsicClassAttributes 제네릭 타입을 사용하여 클래스형 컴포넌트에 대해 동일한 종류의 추가 속성을 지정할 수 있습니다 (함수형 컴포넌트 제외하고). 이 유형에서, 제네릭의 매개변수는 클래스 인스턴스 타입에 해당합니다. React의 경우, 이는 Ref 타입의 ref 속성을 허용하는 데에 쓰입니다. 일반적으로는, JSX 프레임워크 사용자가 모든 태그에 특정 속성을 제공할 필요가 없다면, 이런 인터페이스의 모든 프로퍼티는 선택적이어야 합니다.
스프레드 연산자 또한 동작합니다:
var props = { requiredProp: "bar" };
; // 성공

var badProps = {};
; // 오류

자식 타입 검사 (Children Type Checking)
↥ 위로
TypeScript 2.3부터, TS는 자식 의 타입 검사를 도입했습니다. 자식 은 자식 JSX 표현식 을 속성에 삽입하는 요소 속성 타입의 특수한 프로퍼티입니다.
TS는 JSX.ElementAttributesProperty를 사용해 props 를 결정하는 것과 유사하게, JSX.ElementChildrenAttribute를 사용해 해당 props 내의 자식 의 이름을 결정합니다.
JSX.ElementChildrenAttribute는 단일 프로퍼티로 선언되어야 합니다.
declare namespace JSX {
  interface ElementChildrenAttribute {
    children: {};  // 사용할 자식의 이름을 지정
  }
}


  Hello
;


  Hello
  World
;

const CustomComp = (props) => {props.children}

  Hello World
  {"This is just a JS expression..." + 1000}


다른 속성처럼 자식 의 타입도 지정할 수 있습니다. 예를 들어 React 타이핑 을 사용하는 경우 기본 타입을 오버라이드 할 것입니다.
interface PropsType {
  children: JSX.Element
  name: string
}

class Component extends React.Component {
  render() {
    return (

        {this.props.children}

    )
  }
}

// 성공

  Hello World


// 오류 : 자식은 JSX.Element의 배열이 아닌 JSX.Element 타입입니다.

  Hello World
  Hello World


// 오류 : 자식은 JSX.Element의 배열이나 문자열이 아닌 JSX.Element 타입입니다.

  Hello
  World


JSX 결과 타입 (The JSX result type)
↥ 위로
기본적으로 JSX 표현식의 결과물은 any 타입입니다.
JSX.Element 인터페이스를 수정하여 특정한 타입을 지정할 수 있습니다.
그러나 이 인터페이스에서는 JSX의 요소, 속성, 자식에 대한 정보를 검색할 수 없습니다.
이 인터페이스는 블랙박스입니다.
표현식 포함하기 (Embedding Expressions)
↥ 위로
JSX는 중괄호({ })로 표현식을 감싸 태그 사이에 표현식 사용을 허용합니다.
var a = 
  {["foo", "bar"].map(i => {i / 2})}


위의 코드는 문자열을 숫자로 나눌 수 없으므로 오류를 일으킵니다.
preserve 옵션을 사용할 때, 결과는 다음과 같습니다:
var a = 
  {["foo", "bar"].map(function (i) { return {i / 2}; })}


리액트와 통합하기 (React integration)
↥ 위로
리액트에서 JSX를 사용하기 위해선 React 타이핑을 사용해야 합니다.
이는 리액트를 사용할 수 있도록 JSX 네임스페이스를 적절하게 정의합니다.
/// 

interface Props {
  foo: string;
}

class MyComponent extends React.Component {
  render() {
    return {this.props.foo}
  }
}

; // 성공
; // 오류

팩토리 함수 (Factory Functions)
↥ 위로
jsx: react 컴파일러 옵션에서 사용하는 팩토리 함수는 설정이 가능합니다. 이는 jsxFactory 명령 줄 옵션을 사용하거나 인라인 @jsx 주석을 사용하여 파일별로 설정할 수 있습니다. 예를 들어 jsxFactory에 createElement를 설정했다면, 는 React.createElement("div") 대신 createElement("div")으로 생성될 것입니다.
주석 pragma 버전은 다음과 같이 사용할 수 있습니다 (TypeScript 2.8 기준):
import preact = require("preact");
/* @jsx preact.h */
const x = ;

이는 다음처럼 생성됩니다:
const preact = require("preact");
const x = preact.h("div", null);

선택된 팩토리는 전역 네임스페이스로 돌아가기 전에 JSX 네임스페이스(타입 검사를 위한 정보)에도 영향을 미칩니다. 팩토리가 React.createElement(기본값)로 정의되어 있다면, 컴파일러는 전역 JSX를 검사하기 전에 React.JSX를 먼저 검사할 것입니다. 팩토리가 h로 정의되어 있다면, 컴파일러는 전역 JSX를 검사하기 전에 h.JSX를 검사할 것입니다.

pages/decorators.html.body:
소개 (Introduction)
TypeScript 및 ES6에 클래스가 도입됨에 따라, 클래스 및 클래스 멤버에 어노테이션을 달거나 수정하기 위해 추가 기능이 필요한 특정 시나리오가 있습니다.
데코레이터는 클래스 선언과 멤버에 어노테이션과 메타-프로그래밍 구문을 추가할 수 있는 방법을 제공합니다.
데코레이터는 JavaScript에 대한 2단계 제안이며 TypeScript의 실험적 기능으로 이용 가능합니다.

참고  데코레이터는 향후 릴리스에서 변경될 수 있는 실험적인 기능입니다.

데코레이터에 대한 실험적 지원을 활성화하려면 명령줄 또는 tsconfig.json에서 experimentDecorators 컴파일러 옵션을 활성화해야합니다:
명령줄 (Command Line):
tsc --target ES5 --experimentalDecorators

tsconfig.json:
{
    "compilerOptions": {
        "target": "ES5",
        "experimentalDecorators": true
    }
}

데코레이터 (Decorators)
데코레이터는 클래스 선언, 메서드, 접근자, 프로퍼티 또는 매개 변수에 첨부할 수 있는 특수한 종류의 선언입니다.
데코레이터는 @expression 형식을 사용합니다. 여기서 expression은 데코레이팅 된 선언에 대한 정보와 함께 런타임에 호출되는 함수여야 합니다.
예를 들어, 데코레이터 @sealed를 사용하면 다음과 같이 sealed 함수를 작성할 수 있습니다.
function sealed(target) {
    // 'target' 변수와 함께 무언가를 수행합니다.
}


참고  아래 데코레이터 클래스에서 더 자세한 데코레이터 예제를 볼 수 있습니다.

데코레이터 팩토리 (Decorator Factories)
데코레이터가 선언에 적용되는 방식을 원하는 대로 바꾸고 싶다면 데코레이터 팩토리를 작성할 수 있습니다. 데코레이터 팩토리는 단순히 데코레이터가 런타임에 호출할 표현식을 반환하는 함수입니다.
다음과 같은 방식으로 데코레이터 팩토리를 작성할 수 있습니다.
function color(value: string) { // 데코레이터 팩토리
    return function (target) { // 데코레이터
        // 'target'과 'value' 변수를 가지고 무언가를 수행합니다.
    }
}


참고  아래 메서드 데코레이터에서 데코레이터 팩토리에 대한 자세한 예를 볼 수 있습니다.

데코레이터 합성 (Decorator Composition)
다음 예제와 같이 선언에 여러 데코레이터를 적용할 수 있습니다.

단일 행일 경우:
@f @g x


여러 행일 경우:
@f
@g
x



여러 데코레이터가 단일 선언에 적용되는 경우는 수학의 합성 함수와 유사합니다.
이 모델에서 함수 f와 g을 합성할 때 (f∘g)(x)의 합성 결과는 f(g(x))와 같습니다.
따라서 TypeScript에서 단일 선언에서 여러 데코레이터를 사용할 때 다음 단계가 수행됩니다.

각 데코레이터의 표현은 위에서 아래로 평가됩니다.
그런 다음 결과는 아래에서 위로 함수로 호출됩니다.

데코레이터 팩토리를 사용하는 경우 다음 예제를 통해 이 수행 순서를 관찰 할 수 있습니다.
function f() {
    console.log("f(): evaluated");
    return function (target, propertyKey: string, descriptor: PropertyDescriptor) {
        console.log("f(): called");
    }
}

function g() {
    console.log("g(): evaluated");
    return function (target, propertyKey: string, descriptor: PropertyDescriptor) {
        console.log("g(): called");
    }
}

class C {
    @f()
    @g()
    method() {}
}

이는 결과를 콘솔에 출력합니다.
f(): evaluated
g(): evaluated
g(): called
f(): called

데코레이터 평가 (Decorator Evaluation)
클래스에서 다양한 선언에 데코레이터를 적용하는 방법은 다음과 같이 잘 정의되어 있습니다.

메서드, 접근자 또는 프로퍼티 데코레이터가 다음에 오는 매개 변수 데코레이터는 각 인스턴스 멤버에 적용됩니다.
메서드, 접근자 또는 프로퍼티 데코레이터가 다음에 오는 매개 변수 데코레이터는 각 정적 멤버에 적용됩니다.
매개 변수 데코레이터는 생성자에 적용됩니다.
클래스 데코레이터는 클래스에 적용됩니다.

클래스 데코레이터 (Class Decorators)
클래스 데코레이터는 클래스 선언 직전에 선언됩니다.
클래스 데코레이터는 클래스 생성자에 적용되며 클래스 정의를 관찰, 수정 또는 교체하는 데 사용할 수 있습니다.
클래스 데코레이터는 선언 파일이나 다른 주변 컨텍스트 (예: 선언 클래스)에서 사용할 수 없습니다.
클래스 데코레이터의 표현식은 데코레이팅된 클래스의 생성자를 유일한 인수로 런타임에 함수로 호출됩니다.
클래스 데코레이터가 값을 반환하면 클래스가 선언을 제공하는 생성자 함수로 바꿉니다.

참고  새 생성자 함수를 반환하도록 선택한 경우 원래 프로토타입을 유지 관리해야 합니다.
런타임에 데코레이터를 적용하는 로직은 이 기능을 대신해주지 않습니다.

다음은Greeter 클래스에 적용된 클래스 데코레이터 (@sealed)의 예입니다.
@sealed
class Greeter {
    greeting: string;
    constructor(message: string) {
        this.greeting = message;
    }
    greet() {
        return "Hello, " + this.greeting;
    }
}

다음 함수 선언을 사용하여 @sealed 데코레이터를 정의할 수 있습니다.
function sealed(constructor: Function) {
    Object.seal(constructor);
    Object.seal(constructor.prototype);
}

@sealed가 실행되면 생성자와 프로토 타입을 모두 감쌉니다.
생성자를 재정의하는 방법에 대한 예제는 다음과 같습니다.
function classDecorator(constructor:T) {
    return class extends constructor {
        newProperty = "new property";
        hello = "override";
    }
}

@classDecorator
class Greeter {
    property = "property";
    hello: string;
    constructor(m: string) {
        this.hello = m;
    }
}

console.log(new Greeter("world"));

메서드 데코레이터 (Method Decorators)
메서드 데코레이터는 메서드 선언 직전에 선언됩니다.
데코레이터는 메서드의 프로퍼티 설명자(Property Descriptor) 에 적용되며 메서드 정의를 관찰, 수정 또는 대체하는 데 사용할 수 있습니다.
메서드 데코레이터는 선언 파일, 오버로드 또는 기타 주변 컨텍스트(예: 선언 클래스)에서 사용할 수 없습니다.
메서드 데코레이터의 표현식은 런타임에 다음 세 개의 인수와 함께 함수로 호출됩니다:

정적 멤버에 대한 클래스의 생성자 함수 또는 인스턴스 멤버에 대한 클래스의 프로토타입입니다.
멤버의 이름
멤버의 프로퍼티 설명자


참고  스크립트 대상이 'ES5'보다 낮은 경우 프로퍼티 설명자 는 'undefined'이 됩니다.

메서드 데코레이터가 값을 반환하면, 메서드의 프로퍼티 설명자 로 사용됩니다.

참고  스크립트 대상이 'ES5'보다 낮은 경우 반환 값은 무시됩니다.

다음은 Greeter 클래스의 메서드에 적용된 메서드 데코레이터 (@ enumerable)의 예입니다:
class Greeter {
    greeting: string;
    constructor(message: string) {
        this.greeting = message;
    }

    @enumerable(false)
    greet() {
        return "Hello, " + this.greeting;
    }
}

다음 함수 선언을 사용하여 @enumerable 데코레이터를 정의할 수 있습니다.
function enumerable(value: boolean) {
    return function (target: any, propertyKey: string, descriptor: PropertyDescriptor) {
        descriptor.enumerable = value;
    };
}

@enumerable(false)데코레이터는 데코레이터 팩토리입니다.
@enumerable(false) 데코레이터가 호출되면 프로퍼티 설명자의 enumerable 프로퍼티를 수정합니다.
접근자 데코레이터 (Accessor Decorators)
접근자 데코레이터는 접근자 선언 바로 전에 선언됩니다.
접근자 데코레이터는 접근자의 프로퍼티 설명자에 적용되며 접근자의 정의를 관찰, 수정 또는 교체하는 데 사용할 수 있습니다.
접근자 데코레이터는 선언 파일이나 다른 주변 컨텍스트(예: 선언 클래스)에서 사용할 수 없습니다.

참고  TypeScript는 단일 멤버에 대해 get 및 set 접근자를 데코레이팅 할 수 없습니다.
대신 멤버의 모든 데코레이터를 문서 순서대로 지정된 첫 번째 접근자에 적용해야 합니다.
왜냐하면, 데코레이터는 각각의 선언이 아닌 get과 set 접근자를 결합한 프로퍼티 설명자에 적용되기 때문입니다.

접근자 데코레이터의 표현 식은 런타임에 다음 세 가지 인수와 함께 함수로 호출됩니다:

정적 멤버에 대한 클래스의 생성자 함수 또는 인스턴스 멤버에 대한 클래스의 프로토타입
멤버의 이름
멤버의 프로퍼티 설명자


참고  스크립트 대상이 'ES5'보다 낮은 경우 프로퍼티 설명자는 undefined가 됩니다.

접근자 데코레이터가 값을 반환하면 멤버의 프로퍼티 설명자로 사용됩니다.

참고  스크립트 대상이 'ES5'보다 낮은 경우 반환 값은 무시됩니다.

다음은 Point 클래스의 멤버에 적용되는 접근자 데코레이터 (@configurable)의 예입니다:
class Point {
    private _x: number;
    private _y: number;
    constructor(x: number, y: number) {
        this._x = x;
        this._y = y;
    }

    @configurable(false)
    get x() { return this._x; }

    @configurable(false)
    get y() { return this._y; }
}

다음 함수 선언을 사용하여 @configurable 데코레이터를 정의할 수 있습니다:
function configurable(value: boolean) {
    return function (target: any, propertyKey: string, descriptor: PropertyDescriptor) {
        descriptor.configurable = value;
    };
}

프로퍼티 데코레이터 (Property Decorators)
프로퍼티 데코레이터는 프로퍼티 선언 바로 전에 선언됩니다.
프로퍼티 데코레이터는 선언 파일이나 다른 주변 컨텍스트(예: 선언 클래스)에서 사용할 수 없습니다.
프로퍼티 데코레이터의 표현 식은 런타임에 다음 두 개의 인수와 함께 함수로 호출됩니다:

정적 멤버에 대한 클래스의 생성자 함수 또는 인스턴스 멤버에 대한 클래스의 프로토타입
멤버의 이름


참고  TypeScript에서 프로퍼티 데코레이터가 초기화되는 방식으로 인해 프로퍼티 설명자가 프로퍼티 데코레이터에 대한 인수로 제공되지 않습니다.
현재 프로토타입의 멤버를 정의할 때 인스턴스 프로퍼티를 설명하는 메커니즘이 없고 프로퍼티의 이니셜라이저를 관찰하거나 수정할 수 있는 방법이 없기 때문입니다. 반환 값도 무시됩니다.
따라서 프로퍼티 데코레이터는 특정 이름의 프로퍼티가 클래스에 선언되었음을 관찰하는 데만 사용할 수 있습니다.

이 정보를 사용하여 다음 예와 같이 프로퍼티에 대한 메타데이터를 기록할 수 있습니다:
class Greeter {
    @format("Hello, %s")
    greeting: string;

    constructor(message: string) {
        this.greeting = message;
    }
    greet() {
        let formatString = getFormat(this, "greeting");
        return formatString.replace("%s", this.greeting);
    }
}

다음 함수 선언을 사용하여 @format 데코레이터와 getFormat 함수를 정의 할 수 있습니다:
import "reflect-metadata";

const formatMetadataKey = Symbol("format");

function format(formatString: string) {
    return Reflect.metadata(formatMetadataKey, formatString);
}

function getFormat(target: any, propertyKey: string) {
    return Reflect.getMetadata(formatMetadataKey, target, propertyKey);
}

@format("Hello, %s") 데코레이터는 데코레이터 팩토리입니다.
@format("Hello, %s")가 호출되면 reflect-metadata 라이브러리의 Reflect.metadata 함수를 사용하여 프로퍼티에 대한 메타데이터 항목을 추가합니다.
getFormat이 호출되면 형식의 메타데이터 값을 읽습니다.

참고  이 예제에는 reflect-metadata 라이브러리가 필요합니다.
reflect-metadata 라이브러리에 대한 자세한 내용은 메타데이터를 참조하십시오.

매개변수 데코레이터 (Parameter Decorators)
매개변수 데코레이터는 매개 변수 선언 직전에 선언됩니다.
매개변수 데코레이터는 클래스 생성자 또는 메서드 선언의 함수에 적용됩니다.
매개변수 데코레이터는 선언 파일, 오버로드 또는 다른 주변 컨텍스트(예: 선언 클래스)에서 사용할 수 없습니다.
매개 변수 데코레이터의 표현식은 런타임시 다음 세 개의 인수와 함께 함수로 호출됩니다:

정적 멤버에 대한 클래스의 생성자 함수 또는 인스턴스 멤버에 대한 클래스의 프로토타입
멤버의 이름
함수의 매개 변수 목록에 있는 매개 변수의 서수 색인(ordinal index)


참고  매개변수 데코레이터는 매개변수가 메서드에서 선언되었을 때에만 관찰하는 데에 사용할 수 있습니다.

메개변수 데코레이터의 반환 값은 무시됩니다.
다음은 Greeter 클래스 멤버의 매개 변수에 적용되는 매개 변수 데코레이터 (@required)의 예입니다:
class Greeter {
    greeting: string;

    constructor(message: string) {
        this.greeting = message;
    }

    @validate
    greet(@required name: string) {
        return "Hello " + name + ", " + this.greeting;
    }
}

다음 함수 선언을 사용하여 @required 및 @validate 데코레이터를 정의할 수 있습니다.
import "reflect-metadata";

const requiredMetadataKey = Symbol("required");

function required(target: Object, propertyKey: string | symbol, parameterIndex: number) {
    let existingRequiredParameters: number[] = Reflect.getOwnMetadata(requiredMetadataKey, target, propertyKey) || [];
    existingRequiredParameters.push(parameterIndex);
    Reflect.defineMetadata(requiredMetadataKey, existingRequiredParameters, target, propertyKey);
}

function validate(target: any, propertyName: string, descriptor: TypedPropertyDescriptor) {
    let method = descriptor.value;
    descriptor.value = function () {
        let requiredParameters: number[] = Reflect.getOwnMetadata(requiredMetadataKey, target, propertyName);
        if (requiredParameters) {
            for (let parameterIndex of requiredParameters) {
                if (parameterIndex >= arguments.length || arguments[parameterIndex] === undefined) {
                    throw new Error("Missing required argument.");
                }
            }
        }

        return method.apply(this, arguments);
    }
}

@required 데코레이터는 필요에 따라 매개변수를 표시하는 메타데이터 항목을 추가합니다.
그런 다음 @validate 데코레이터는 원래 메서드를 호출하기 전에 인수 유효성 검증하는 함수로 기존의 greet 메서드를 감쌉니다.

참고  이 예제에는 reflect-metadata 라이브러리가 필요합니다.
reflect-metadata 라이브러리에 대한 자세한 내용은 [메타데이터] (#메타데이터-metadata)를 참조하십시오.

메타데이터 (Metadata)
일부 예제는 실험적 메타데이터 API에 대한 폴리필(polyfill)을 추가하는 reflect-metadata 라이브러리를 사용합니다.
이 라이브러리는 아직 ECMAScript (JavaScript) 표준의 일부가 아닙니다.
그러나 데코레이터가 공식적으로 ECMAScript 표준의 일부로 채택되면 이러한 확장을 채택하게 될 것입니다.
npm을 통해 설치할 수 있습니다.
npm i reflect-metadata --save

TypeScript에는 데코레이터가 있는 선언에 대해 특정 타입의 메타 데이터를 내보내는 실험적인 지원을 포함합니다.
이 실험적인 지원을 가능하게 하려면, 명령행 또는tsconfig.json에서 emitDecoratorMetadata 컴파일러 옵션을 설정해야 합니다.
명령줄:
tsc --target ES5 --experimentalDecorators --emitDecoratorMetadata

tsconfig.json:
{
    "compilerOptions": {
        "target": "ES5",
        "experimentalDecorators": true,
        "emitDecoratorMetadata": true
    }
}

활성화되면 reflect-metadata라이브러리를 가져오기만 하면 추가 디자인-타임 타입 정보가 런타임에 사용 가능합니다.
다음 예제에서 이를 확인할 수 있습니다.
import "reflect-metadata";

class Point {
    x: number;
    y: number;
}

class Line {
    private _p0: Point;
    private _p1: Point;

    @validate
    set p0(value: Point) { this._p0 = value; }
    get p0() { return this._p0; }

    @validate
    set p1(value: Point) { this._p1 = value; }
    get p1() { return this._p1; }
}

function validate(target: any, propertyKey: string, descriptor: TypedPropertyDescriptor) {
    let set = descriptor.set;
    descriptor.set = function (value: T) {
        let type = Reflect.getMetadata("design:type", target, propertyKey);
        if (!(value instanceof type)) {
            throw new TypeError("Invalid type.");
        }
        set.call(target, value);
    }
}

TypeScript 컴파일러는 @Reflect.metadata 데코레이터를 사용하여 디자인-타임 타입 정보를 주입합니다.
다음 TypeScript와 동일하다고 생각할 수 있습니다.
class Line {
    private _p0: Point;
    private _p1: Point;

    @validate
    @Reflect.metadata("design:type", Point)
    set p0(value: Point) { this._p0 = value; }
    get p0() { return this._p0; }

    @validate
    @Reflect.metadata("design:type", Point)
    set p1(value: Point) { this._p1 = value; }
    get p1() { return this._p1; }
}


참고  데코레이터 메타 데이터는 실험적인 기능으로 향후 릴리스에서 주요 변경 사항이 있을 수 있습니다.

pages/mixins.html.body:
Mixin
소개(Introduction)
전통적인 객쳬지향 계층과 함께, 재사용 가능한 컴포넌트로 부터 클래스를 빌드하는 또 다른 일반적인 방법으로, 간단한 부분클래스를 결합하여 빌드하는 것입니다. 스칼라 등의 언어를 통해서, 믹스인에 대한 개념과 특성은 익숙할 수 있을 것이며, 패턴은 JavaScript 커뮤니티에서도 어느 정도의 인기를 얻었습니다.
예시 코드(Code Sample)
아래 코드에서는 TypeScript에서 mixin의 모델링 방식을 보여줍니다. 코드를 본 후, 작동 방식을 살펴보도록 하겠습니다.
// Disposable Mixin
class Disposable {
    isDisposed: boolean;
    dispose() {
        this.isDisposed = true;
    }

}

// Activatable Mixin
class Actiavatable {
    isActive: boolean;
    activate() {
        this.isActive = true;
    }
    deactivate() {
        this.isActive = false;
    }
}

class SmartObject {
    constructor() {
        setInterval(() => console.log(this.isActive + " : " + this.isDisposed), 500);
    }

    interact() {
        this.activate();
    }
}

interface SmartObject extends Disposable, Activatable {}
applyMixins(SmartObject, [Disposable, Activatable]);

let smartObj = new SmartObject();
setTimeout(() => smartObj.interact(), 1000);

////////////////////////////////////////
// In your runtime library somewhere
////////////////////////////////////////

function applyMixins(derivedCtor: any, baseCtors: any[]) {
    baseCtors.forEach(baseCtor => {
        Object.getOwnPropertyNames(baseCtor.prototype).forEach(name => {
            Object.defineProperty(derivedCtor.prototype, name, Object.getOwnPropertyDescriptor(baseCtor.prototype, name));
        });
    });
}

예시 알아보기(Understanding the sample)
예시 코드는 mixin을 수행하는 두 클래스로 시작합니다. 두 클래스는 각각 부분적인 기능에 집중되어 있음을 알 수 있습니다. 이후에는 두 기능을 모두 사용하여 새로운 클래스를 만들기 위해 이들을 혼합(mix)할 것입니다.
// Disposable Mixin
class Disposable {
    isDisposed: boolean;
    dispose() {
        this.isDisposed = true;
    }

}

// Activatable Mixin
class Activatable {
    isActive: boolean;
    activate() {
        this.isActive = true;
    }
    deactivate() {
        this.isActive = false;
    }
}

다음으로, 두 mixin의 결합을 처리 할 클래스를 만듭니다. 이것이 어떻게 작동하는지 더 자세히 살펴 보겠습니다.
class SmartObject {
    ...
}

interface SmartObject extends Disposable, Activatable {}

첫 번째 사항은 SmartObject 클래스에서 Disposable과 Activatable을 확장하는 대신 SmartObject 인터페이스에서 확장한다는 것입니다. Declaration merging으로 인해 SmartObject 인터페이스가 SmartObject 클래스에 혼합됩니다.
클래스를 인터페이스로 취급하고 Disposable 및 Activatable 뒤에있는 유형 만 구현이 아닌 SmartObject 유형으로 혼합합니다. 이것은 우리가 클래스에서 구현에서 mixin을 제공해야 한다는 것을 의미합니다. 그 외에는 mixin의 사용을 피할 수 있습니다.
마지막으로 클래스에 구현에서, mixin을 혼합(mix)합니다.
applyMixins(SmartObject, [Disposable, Activatable]);

마지막으로, 우리를 위해 mixin을 수행 할 도우미 함수를 만듭니다. 그러면 각 mixin의 속성이 실행되고 mixin의 대상으로 복사되어 독립형 속성을 구현합니다.
function applyMixins(derivedCtor: any, baseCtors: any[]) {
    baseCtors.forEach(baseCtor => {
        Object.getOwnPropertyNames(baseCtor.prototype).forEach(name => {
            Object.defineProperty(derivedCtor.prototype, name, Object.getOwnPropertyDescriptor(baseCtor.prototype, name));
        });
    });
}

pages/triple-slash-directives.html.body:
트리플-슬래시(Triple-slash) 지시어는 단일 XML 태그를 포함하는 한 줄 주석입니다.
주석의 내용은 컴파일러 지시어로 사용됩니다.
트리플-슬래시 지시어는 오직 포함된 파일의 상단에서만 유효합니다.
트리플-슬래시 지시어는 다른 트리플-슬래시 지시어를 포함한 한 줄 혹은 여러 줄의 주석 앞에만 위치할 수 있습니다.
만약 문 혹은 선언 뒤에 나오는 경우, 보통의 한 줄 주석으로 여겨지며 어떤 특별한 의미도 갖지 않습니다.
/// 
///  지시어는 가장 일반적인 지시어입니다.
파일 간 의존성 선언으로 사용됩니다.
트리플-슬래시 참조는 컴파일 프로세스에 추가적인 파일을 포함하도록 컴파일러에게 지시합니다.
또한 --out 또는 --outFile을 사용할 때 출력물을 정렬하기 위한 방법으로도 사용됩니다.
파일은 전처리 통과 후 입력과 동일한 순서로 출력 파일 위치에 생성됩니다.
입력 파일 전처리 (Preprocessing input files)
컴파일러는 모든 트리플-슬래시 참조 지시어를 분석하기 위해 입력 파일에 대한 전처리를 수행합니다.
이 과정에서, 추가 파일이 컴파일에 추가됩니다.
이 과정은 root files 집합에서 시작합니다;
이것들은 커맨드-라인이나 tsconfig.json 파일의 "files"목록에 지정된 파일 이름입니다.
이 루트 파일들은 지정된 순서대로 전처리 됩니다.
파일이 목록에 추가되기 전, 파일에 있는 모든 트리플-슬래시 참조가 처리되고 그 대상들이 포함됩니다.
트리플-슬래시 참조는 파일에서 보이는 순서대로 깊이 우선으로 처리됩니다.
루트가 없는 경우 트리플-슬래시 참조 경로는 이를 포함하고 있는 파일을 기준으로 처리됩니다.
오류 (Errors)
존재하지 않는 파일을 참조하는 것은 오류입니다.
파일이 자기 자신에 대한 트리플-슬래시 참조를 갖는 것은 오류입니다.
--noResolve 사용하기 (Using --noResolve)
컴파일러 플래그 --noResolve가 지정되면 트리플-슬래시 참조는 무시됩니다; 새 파일을 추가하거나 제공된 파일의 순서를 변경하지 않습니다.
/// 
의존성을 선언 역할을 하는 ///  지시어와 유사하게, ///  지시어는 패키지의 의존성을 선언합니다.
패키지 이름을 처리하는 과정은 import 문에서 모듈 이름을 처리하는 과정과 유사합니다.
트리플-슬래시-참조-타입 지시어를 선언 패키지의 import로 생각하면 이해하기 쉽습니다.
예를 들어, 선언 파일에 /// 를 포함하는 것은 이 파일이 @types/node/index.d.ts에 선언된 이름을 사용한다고 선언하며;
따라서 이 패키지는 선언 파일과 함께 컴파일에 포함되어야 합니다.
이 지시어는 d.ts 파일을 직접 작성할 때만 사용하세요.
컴파일 중 생성된 선언 파일의 경우, 컴파일러는 자동으로 /// 를 추가합니다;
오직 결과 파일이 참조된 패키지의 선언문을 사용하는 경우에만 생성된 선언 파일 안에 ///  가 추가됩니다.
.ts 파일에서 @type의 패키지의 의존성을 선언하려면, 커맨드 라인에 --types 을 사용하거나  tsconfig.json을 사용하세요.
tsconfig.json에서 @types, typeRoots 과 types 사용하기에서 세부 사항을 확인하세요.
/// 
이 지시어는 파일이 명시적으로 기존 내장 lib 파일을 포함하도록 합니다.
내장 lib 파일은 tsconfig.json의"lib"컴파일러 옵션과 같은 방식으로 참조됩니다 (예 :lib = "es2015.d"ts가 아닌 lib = "es2015"사용 등).
DOM API 또는Symbol 또는 Iterable과 같은 내장 JS 런타임 생성자와 같은 내장 타입에 의존하는 선언 파일 작성자에게는 트리플 슬래시 참조 lib 지시어를 사용하는 것이 권장됩니다. 이전에는 이런 .d.ts 파일은 그런 타입의 전달/중복 선언을 추가했어야 했습니다.
예를 들어 컴파일에서 파일 중 하나에 /// 를 추가한 것 것은 --lib es2017.string으로 컴파일 하는 것과 같습니다.
/// 

"foo".padStart(4);

/// 
이 지시어는 파일을 기본 라이브러리라고 표시합니다.
이 주석은 lib.d.ts와 이를 변형한 것들의 맨 상단에서 볼 수 있습니다.
이 지시어는 컴파일러에게 기본 라이브러리(예.lib.d.ts)를 컴파일에 포함시키지 않도록 지시합니다.
이는 커맨드 라인에 --nolib을 넘겨주는 것과 비슷한 영향을 줍니다.
또한 --skipDefaultLibCheck를 넘겨주면, 컴파일러가 ///  을 갖는 파일만 검사하지 않는다는 것을 유의하세요.
/// 
기본적으로 AMD 모듈은 익명으로 생성됩니다.
이는 모듈로 만들어 내는 과정에 번들러(예. r.js)와 같은 다른 툴을 사용할 경우 문제를 발생시킬 수 있습니다.
amd-module 지시어는 컴파일러에게 선택적으로 모듈의 이름을 넘길 수 있도록 해줍니다:
amdModule.ts
///
export class C {
}

이는 AMD define 호출의 일부로 NamedModule 이름을 모듈에 할당하는 결과를 낳을 것입니다:
amdModule.js
define("NamedModule", ["require", "exports"], function (require, exports) {
    var C = (function () {
        function C() {
        }
        return C;
    })();
    exports.C = C;
});

/// 

Note: 이 지시어는 deprecated 되었습니다. 대신 import "moduleName"; 문을 사용하세요.

/// 는 컴파일러에게 TS-가 아닌 모듈의 의존성이 결과 모듈의 require 호출에 추가되어야 한다고 알립니다.
amd-dependeny 지시어는 선택적으로 name 프로퍼티를 갖습니다; 이로 인해 amd-dependency에 선택적으로 이름을 전달할 수 있습니다:
/// 
declare var moduleA:MyType
moduleA.callStuff()

생성된 JS 코드:
define(["require", "exports", "legacy/moduleA"], function (require, exports, moduleA) {
    moduleA.callStuff()
});

pages/type-checking-javascript-files.htm.body:
TypeScript 2.3 이상의 버전에서는 --checkJs를 사용해 .js 파일에서 타입 검사 및 오류 보고를 지원합니다.
// @ts-nocheck 주석을 달아 일부 파일에서 타입 검사를 건너뛸 수 있으며; 반대로 // @ts-check 주석을 달아 --checkJs를 사용하지 않고 일부 .js 파일에 대해서만 타입 검사를 하도록 선택할 수 있습니다.
또한 특정 부분의 앞 줄에 // @ts-ignore를 달아 에러를 무시할 수도 있습니다.
tsconfig.json이 있는 경우, JavaScript 검사는 noImplicitAny, strictNullChecks 등의 엄격한 플래그를 우선시한다는 점을 알아두세요.
하지만, JavaScript 검사의 상대적인 느슨함 덕분에 엄격한 플래그와 결합하여 사용하는 것은 놀라운 결과를 보여줄 것입니다.
.ts 파일과 .js 파일은 타입을 검사하는 방법에 몇 가지 주목할만한 차이점이 있습니다:
타입 정보로 사용되는 JSDoc 타입 (JSDoc types are used for type information)
.js 파일에서는, 흔히 .ts 파일처럼 타입을 추론해볼 수 있습니다.
타입을 추론할 수 없는 경우, .ts의 타입 표시와 같은 방법으로 JSDoc을 사용해 이를 지정할 수 있습니다.
TypeScript와 마찬가지로, --noImplicitAny는 컴파일러가 타입을 유추할 수 없는 부분에서 오류를 보고할 것입니다.
(확장 가능한 객체 리터럴을 제외하고; 자세한 내용은 아래를 참고하세요.)
선언에 JSDoc 표시를 사용하면 해당 선언의 타입을 설정할 수 있습니다. 예를 들면:
/** @type {number} */
var x;

x = 0;      // 성공
x = false;  // 오류: 불리언(boolean)에는 숫자를 할당할 수 없음

사용 가능한 JSDoc 패턴 목록은 이곳에서 확인할 수 있습니다.
클래스 본문의 할당에서 추론된 프로퍼티 (Properties are inferred from assignments in class bodies)
ES2015에는 클래스에 프로퍼티를 선언할 수 있는 수단이 없습니다. 프로퍼티는 객체 리터럴과 같이 동적으로 할당됩니다.
.js 파일에서, 컴파일러는 클래스 본문 내부에서 할당된 프로퍼티로부터 프로퍼티들을 추론합니다.
생성자가 정의되어 있지 않거나, 생성자에서 정의된 타입이 undefined나 null이 아닐 경우, 프로퍼티의 타입은 생성자에서 주어진 타입과 동일합니다.
전자에 해당 프로퍼티의 경우, 할당되었던 모든 값들의 타입을 가진 유니언 타입이 됩니다.
생성자에 정의된 프로퍼티는 항상 존재하는 것으로 가정하는 반면, 메서드, getter, setter에서만 정의된 프로퍼티는 선택적인 것으로 간주합니다.
class C {
    constructor() {
        this.constructorOnly = 0
        this.constructorUnknown = undefined
    }
    method() {
        this.constructorOnly = false // 오류, constructorOnly는 Number 타입임
        this.constructorUnknown = "plunkbat" // 성공, constructorUnknown의 타입은 string | undefined
        this.methodOnly = 'ok'  // 성공, 그러나 methodOnly는 undefined 타입 또한 허용됨
    }
    method2() {
        this.methodOnly = true  // 이 또한 성공, methodOnly의 타입은 string | boolean | undefined
    }
}

프로퍼티가 클래스 본문에서 설정되지 않았다면, 알 수 없는 것으로 간주합니다.
클래스에 읽기 전용 프로퍼티가 있는 경우, 생성자에서 선언에 JSDoc을 사용하여 타입을 추가하여 표시합니다.
이후엔 초기화하더라도 값을 지정할 필요가 없습니다.
class C {
    constructor() {
        /** @type {number | undefined} */
        this.prop = undefined;
        /** @type {number | undefined} */
        this.count;
    }
}

let c = new C();
c.prop = 0;          // 성공
c.count = "string";  // 오류: string 은 number|undefined에 할당할 수 없음

생성자 함수와 클래스는 동일 (Constructor functions are equivalent to classes)
ES2015 이전에는, JavaScript는 클래스 대신 생성자 함수를 사용했습니다.
컴파일러는 이러한 패턴을 지원하며 생성자 함수를 ES2015 클래스와 동일한 것으로 이해합니다.
앞서 설명한 프로퍼티 추론 규칙 또한 정확히 같은 방식으로 작용합니다.
function C() {
    this.constructorOnly = 0
    this.constructorUnknown = undefined
}
C.prototype.method = function() {
    this.constructorOnly = false // 오류
    this.constructorUnknown = "plunkbat" // 성공, 타입은 string | undefined가 됨
}

CommonJS 모듈 지원 (CommonJS modules are supported)
.js 파일에서, TypeScript는 CommonJS 모듈 포맷을 이해합니다.
exports와 module.exports 할당은 export 선언으로 인식됩니다.
마찬가지로, require 함수 호출은 모듈 import로 인식됩니다. 예를 들어:
// `import module "fs"`와 같음
const fs = require("fs");

// `export function readFile`과 같음
module.exports.readFile = function(f) {
    return fs.readFileSync(f);
}

JavaScript의 모듈 지원은 TypeScript의 모듈 지원보다 구문적으로 훨씬 관용적입니다.
따라서 대부분의 할당과 선언의 조합이 지원됩니다.
클래스, 함수, 객체 리터럴은 네임스페이스 (Classes, functions, and object literals are namespaces)
.js 파일에 있는 클래스는 네임스페이스입니다.
예를 들어, 다음과 같이 클래스를 중첩하는 데에 사용할 수 있습니다:
class C {
}
C.D = class {
}

그리고 ES2015 이전 코드의 경우, 정적 메서드를 나타내는 데에 사용할 수도 있습니다:
function Outer() {
  this.y = 2
}
Outer.Inner = function() {
  this.yy = 2
}

또한 간단한 네임스페이스를 생성하는 데에 사용할 수도 있습니다:
var ns = {}
ns.C = class {
}
ns.func = function() {
}

다른 번형도 허용됩니다:
// 즉시 호출 함수(IIFE)
var ns = (function (n) {
  return n || {};
})();
ns.CONST = 1

// 전역으로 기본 설정
var assign = assign || function() {
  // 여기엔 코드를
}
assign.extra = 1

객체 리터럴은 확장 가능 (Object literals are open-ended)
.ts 파일에서, 변수 선언을 초기화하는 객체 리터럴은 선언에 해당 타입을 부여합니다.
원본 리터럴에 명시되어 있지 않은 새 멤버는 추가될 수 없습니다.
이 규칙은 .js 파일에선 완화됩니다; 객체 리터럴은 원본에 정의되지 않은 새로운 프로퍼티를 조회하고 추가하는 것이 허용되는 확장 가능한 타입(인덱스 시그니처)을 갖습니다.
예를 들어:
var obj = { a: 1 };
obj.b = 2;  // 허용됨

객체 리터럴은 마치 닫힌 객체가 아니라 열린 맵(maps)으로 다뤄지도록 [x:string]: any와 같은 인덱스 시그니처를 가진 것처럼 동작합니다.
다른 특정 JavaScript 검사 동작과 마찬가지로, 해당 동작은 변수에 JSDoc 타입을 지정하여 변경할 수 있습니다. 예를 들어:
/** @type {{a: number}} */
var obj = { a: 1 };
obj.b = 2;  // 오류, {a: number}타입엔 b 프로퍼티가 없음

null, undefined 및 빈 배열 이니셜라이저는 any 혹은 any[] 타입 (null, undefined, and empty array initializers are of type any or any[])
null 또는 undefined로 초기화된 변수나 매개변수 또는 프로퍼티는, 엄격한 null 검사가 있더라도 any 타입을 갖게 될 것입니다.
[]로 초기화된 변수나 매개변수 또는 프로퍼티는, 엄격한 null 검사가 있더라도 any[] 타입을 갖게 될 것입니다.
위에서 설명한 여러 이니셜라이저(initializer)를 갖는 프로퍼티만이 유일한 예외입니다.
function Foo(i = null) {
    if (!i) i = 1;
    var j = undefined;
    j = 2;
    this.l = [];
}
var foo = new Foo();
foo.l.push(foo.i);
foo.l.push("end");

함수 매개변수는 기본적으로 선택 사항 (Function parameters are optional by default)
ES2015 이전의 JavaScript는 선택적인 매개변수를 지정할 방법이 없었기 때문에, .js 파일에선 모든 함수의 매개변수는 선택적인 것으로 간주됩니다.
선언된 매개변수보다 적은 인수로 호출하는 것이 허용됩니다.
그러나 너무 많은 인수를 넣어 호출하면 오류를 일으킨다는 것에 유의하세요.
예를 들어:
function bar(a, b) {
    console.log(a + " " + b);
}

bar(1);       // 성공, 두 번째 인수는 선택 사항임
bar(1, 2);
bar(1, 2, 3); // 오류, 인수의 갯수가 너무 많음

JSDoc 표시가 된 함수는 이 규칙에서 예외입니다.
JSDoc의 선택적 매개변수 구문을 사용하여 선택 사항을 표시할 수 있습니다. 예시:
/**
 * @param {string} [somebody] - 누군가의 이름
 */
function sayHello(somebody) {
    if (!somebody) {
        somebody = 'John Doe';
    }
    console.log('Hello ' + somebody);
}

sayHello();

arguments 사용으로부터 추론된 var-args 매개변수 선언 (Var-args parameter declaration inferred from use of arguments)
arguments 참조를 참조하는 본문을 가진 함수는, 암묵적으로 var-args 매개변수(예: (...arg: any[]) => any)를 갖는 것으로 간주합니다. JSDoc의 var-args 구문을 사용하여 인수의 타입을 지정할 수 있습니다.
/** @param {...number} args */
function sum(/* numbers */) {
    var total = 0
    for (var i = 0; i 
타입이 지정되지 않은 매개변수는 기본적으로 any임 (Unspecified type parameters default to any)
JavaScript에는 제네릭 타입의 매개변수를 지정하는 구문이 없으므로, 타입이 지정되지 않은 매개변수는 기본적으로 any 타입입니다.
확장 절에서 (In extends clause)
예를 들어, React.Component는 Props와 State라는 두 타입의 매개변수를 갖도록 정의되어 있습니다.
.js 파일에는 이러한 것들을 확장 절에 지정할 수 있는 정당한 방법이 없습니다. 기본적으로 해당 타입 인수는 any가 될 것입니다:
import { Component } from "react";

class MyComponent extends Component {
    render() {
        this.props.b; // this.props의 타입이 any이므로 허용됨
    }
}

타입을 명시적으로 지정하려면 JSDoc의 @augments를 사용하세요. 예를 들어:
import { Component } from "react";

/**
 * @augments {Component}
 */
class MyComponent extends Component {
    render() {
        this.props.b; // 오류: b 는 {a:number}에 속하지 않음
    }
}

JSDoc 참조에서 (In JSDoc references)
JSDoc의 지정되지 않은 타입 인수는 기본적으로 any입니다:
/** @type{Array} */
var x = [];

x.push(1);        // 성공
x.push("string"); // 성공, x는 Array 타입임

/** @type{Array.} */
var y = [];

y.push(1);        // 성공
y.push("string"); // 오류, string을 number 타입에 할당할 수 없음

함수 호출에서 (In function calls)
제네릭 함수의 호출은 인수를 사용해 타입 매개변수를 추론합니다. 때때로 이 과정은 추론 소스가 부족하여 어떠한 타입도 추론하지 못하는 경우가 있습니다; 이러한 경우, 매개변수 타입은 기본적으로 any입니다. 예를 들어:
var p = new Promise((resolve, reject) => { reject() });

p; // Promise;

지원되는 JSDoc (Supported JSDoc)
아래의 구성은 JavaScript 파일에서 JSDoc 주석을 사용하여 타입 정보를 제공할 때 지원되는 목록입니다.
아래에 명시되지 않은 태그(@async 등)는 아직 지원되지 않는다는 점에 유의하세요.

@type
@param (또는 @arg 또는 @argument)
@returns (또는 @return)
@typedef
@callback
@template
@class (또는 @constructor)
@this
@extends (또는 @augments)
@enum

 대부분의 태그의 의미는 usejsdoc.org에서 설명하는 태그의 의미와 같습니다.
아래의 코드는 차이점을 설명하고 각 태그의 사용 예시를 설명합니다.
@type
"@type" 태그를 사용하고 타입 이름을 참조(원래 TypeScript의 선언에 정의된 것 또는 JSDoc의 "@typedef" 태그 중 하나)할 수 있 습니다.
모든 TypeScript의 타입, 대부분의 JSDoc 타입 중 어떤 것이든 사용할 수 있습니다.
/**
 * @type {string}
 */
var s;

/** @type {Window} */
var win;

/** @type {PromiseLike} */
var promisedString;

// HTML 요소를 DOM 프로퍼티로 지정할 수 있음
/** @type {HTMLElement} */
var myElement = document.querySelector(selector);
element.dataset.myData = '';

@type은 유니언 타입으로 지정할 수 있습니다; 예를 들어, 문자열과 불리언 중 어떤 것이든 될 수 있습니다.
/**
 * @type {(string | boolean)}
 */
var sb;

유니언 타입에는 괄호가 선택 사항이라는 점에 유의하세요.
/**
 * @type {string | boolean}
 */
var sb;

다양한 구문을 사용하여 배열 타입을 지정할 수도 있습니다:
/** @type {number[]} */
var ns;
/** @type {Array.} */
var nds;
/** @type {Array} */
var nas;

또한 객체 리터럴 타입을 지정할 수도 있습니다.
예를 들어, 프로퍼티 'a' (string) 와 'b' (number)를 갖는 오브젝트라면 다음과 같은 구문을 사용할 수 있습니다.
/** @type {{ a: string, b: number }} */
var var9;

표준 JSDoc 구문 또는 TypeScript 구문을 통해 문자열 혹은 숫자 인덱스 시그니처를 사용하여 유사-맵 혹은 유사-배열 오브젝트를 지정할 수도 있습니다.
/**
 * 임의의 `string` 프로퍼티를 `number`에 매핑하는 유사-맵 객체.
 *
 * @type {Object.}
 */
var stringToNumber;

/** @type {Object.} */
var arrayLike;

앞의 두 타입은 TypeScript의 { [x: string]: number } 그리고 { [x: number]: any }와 동일합니다. 컴파일러는 두 구문을 모두 이해할 것입니다.
함수 타입은 TypeScript 또는 클로저 구문을 사용하여 지정할 수 있습니다:
/** @type {function(string, boolean): number} Closure 구문 */
var sbn;
/** @type {(s: string, b: boolean) => number} TypeScript 구문 */
var sbn2;

혹은 단순히 지정되지 않은 Function 타입을 사용할 수도 있습니다:
/** @type {Function} */
var fn7;
/** @type {function} */
var fn6;

Closure의 다른 타입 또한 동작합니다:
/**
 * @type {*} - 어떠한 타입이든 될 수 있음
 */
var star;
/**
 * @type {?} - 식별되지 않은 타입 ('any'와 같음)
 */
var question;

캐스트 (Casts)
TypeScript는 클로저의 캐스트(cast) 구문을 차용합니다.
이는 괄호화된 표현식 앞에 @type 태그를 사용하여 다른 타입으로의 캐스트를 가능케 합니다.
/**
 * @type {number | string}
 */
var numberOrString = Math.random() 
타입 import (Import types)
타입 import를 사용하여 다른 파일의 선언을 가져올 수도 있습니다.
이 구문은 TypeScript에 특화된 것이며 JSDoc 표준과는 조금 다릅니다:
/**
 * @param p { import("./a").Pet }
 */
function walk(p) {
    console.log(`Walking ${p.name}...`);
}

타입 import는 타입 별칭 선언에서도 쓰일 수 있습니다:
/**
 * @typedef { import("./a").Pet } Pet
 */

/**
 * @type {Pet}
 */
var myPet;
myPet.name;

타입을 모르거나 입력하기 귀찮은 큰 타입이 있을 경우, 타입 import를 사용하여 모듈에서 값의 타입을 가져올 수 있습니다:
/**
 * @type {typeof import("./a").x }
 */
var x = require("./a").x;

@param and @returns
@param은 @type과 같은 종류의 구문을 사용하지만, 매개변수의 이름이 추가됩니다.
매개변수는 이름을 대괄호로 둘러싸서 선택적으로 선언할 수 있습니다:
// 매개변수는 다양한 형태의 구문으로 선언될 수 있음
/**
 * @param {string}  p1 - 문자열 매개변수.
 * @param {string=} p2 - 선택적 문자열 매개변수 (클로저 구문)
 * @param {string} [p3] - 또다른 선택적 매개변수 (JSDoc 구문).
 * @param {string} [p4="test"] - 기본값을 가진 선택적 매개변수
 * @return {string} 결과
 */
function stringsStringStrings(p1, p2, p3, p4){
  // TODO
}

마찬가지로, 함수의 반환 타입으로는:
/**
 * @return {PromiseLike}
 */
function ps(){}

/**
 * @returns {{ a: string, b: number }} - '@returns'과 '@return' 모두 사용 가능
 */
function ab(){}

@typedef, @callback, and @param
@typedef를 사용해 복잡한 타입을 정의할 수 있습니다.
@param과 비슷한 구문으로 동작합니다.
/**
 * @typedef {Object} SpecialType - 'SpecialType'이라는 새 타입을 생성
 * @property {string} prop1 - SpecialType의 문자열 프로퍼티
 * @property {number} prop2 - SpecialType의 숫자 프로퍼티
 * @property {number=} prop3 - SpecialType의 선택적 숫자 프로퍼티
 * @prop {number} [prop4] - SpecialType의 선택적 숫자 프로퍼티
 * @prop {number} [prop5=42] - SpecialType의 기본값을 가진 선택적 숫자 프로퍼티
 */
/** @type {SpecialType} */
var specialTypeObject;

첫 번째 줄에 object나 Object를 사용할 수 있습니다.
/**
 * @typedef {object} SpecialType1 - 'SpecialType1'이라는 새 타입 생성
 * @property {string} prop1 - SpecialType1의 문자열 프로퍼티
 * @property {number} prop2 - SpecialType1의 숫자 프로퍼티
 * @property {number=} prop3 - SpecialType1의 선택적 숫자 프로퍼티
 */
/** @type {SpecialType1} */
var specialTypeObject1;

@param은 일회성인 타입 지정에 대한 비슷한 구문을 허용합니다.
중첩된 프로퍼티 이름  앞엔 매개변수 이름을 붙여야 함을 유의하세요:
/**
 * @param {Object} options - 해당 형태는 위의 SpecialType과 동일
 * @param {string} options.prop1
 * @param {number} options.prop2
 * @param {number=} options.prop3
 * @param {number} [options.prop4]
 * @param {number} [options.prop5=42]
 */
function special(options) {
  return (options.prop4 || 1001) + options.prop5;
}

@callback은 @typedef와 비슷합니다만, 객체 타입 대신 함수의 타입을 지정합니다:
/**
 * @callback Predicate
 * @param {string} data
 * @param {number} [index]
 * @returns {boolean}
 */
/** @type {Predicate} */
const ok = s => !(s.length % 2);

물론, 이러한 유형 중 어떤 것이라도 단일 라인의 @typedef TypeScript 구문을 사용해 선언될 수 있습니다:
/** @typedef {{ prop1: string, prop2: string, prop3?: number }} SpecialType */
/** @typedef {(data: string, index?: number) => boolean} Predicate */

@template
@template 태그로 제네릭 타입을 선언할 수 있습니다:
/**
 * @template T
 * @param {T} x - 리턴 타입까지 사용되는 제네릭 매개변수
 * @return {T}
 */
function id(x){ return x }

콤마 또는 여러 태그를 사용하여 여러 매개변수 타입을 선언할 수 있습니다:
/**
 * @template T,U,V
 * @template W,X
 */

타입 매개변수 이름 앞에 타입 제약 조건을 지정할 수도 있습니다.
목록의 첫 번째 매개변수의 타입만 제한됩니다:
/**
 * @template {string} K - K는 문자열 혹은 문자열 리터럴이어야만 함
 * @template {{ serious(): string }} Seriousalizable - serious 메서드를 가져야만 함
 * @param {K} key
 * @param {Seriousalizable} object
 */
function seriousalize(key, object) {
  // ????
}

@constructor
컴파일러는 this-프로퍼티 할당을 기반으로 생성자 함수를 추론합니다만, @constructor 태그를 추가하여 보다 엄격한 검사와 더 나은 제안이 되도록 만들 수 있습니다.
/**
 * @constructor
 * @param {number} data
 */
function C(data) {
  this.size = 0;
  this.initialize(data); // 이니셜라이저에 문자열이 들어갈 경우, 오류 발생 가능
}
/**
 * @param {string} s
 */
C.prototype.initialize = function (s) {
  this.size = s.length
}

var c = new C(0);
var result = C(1); // C는 새 인스턴스로만 호출해야 함

@constructor를 사용하면, this는 C의 생성자 함수 내부에서 검사되므로, initailize 메서드에 대하여 알 수 있을 것이며 숫자를 넘길 경우 오류가 발생할 것입니다. 또한 C를 생성하지 않고 호출할 경우 오류를 일으킬 것입니다.
불행하게도, 이는 호출 가능한 생성자 함수는 @constructor를 사용할 수 없다는 것을 의미합니다.
@this
컴파일러는 대게 작업할 컨텍스트가 있을 때 this의 타입을 알아낼 수 있습니다. 그렇지 않은 경우, @this를 사용해 this의 타입을 명시할 수 있습니다:
/**
 * @this {HTMLElement}
 * @param {*} e
 */
function callbackForLater(e) {
    this.clientHeight = parseInt(e) // 잘 되어야 함!
}

@extends
JavaScript 클래스엔 제네릭 기초 클래스를 확장할 때, 매개변수가 어떤 타입이 되어야 하는지 지정할 곳이 없습니다. @extends 태그는 해당 매개변수 타입에 대한 위치를 제공합니다:
/**
 * @template T
 * @extends {Set}
 */
class SortableSet extends Set {
  // ...
}

@extends는 클래스에서만 작동한다는 점을 알아두세요. 현재로서는, 생성자 함수가 클래스를 확장하는 방법은 없습니다.
@enum
@enum 태그를 사용하면 해당 멤버가 모두 지정된 타입인 객체 리터럴을 생성할 수 있습니다. 대부분의 JavaScript 객체 리터럴과는 다르게, 다른 멤버는 허용되지 않습니다.
/** @enum {number} */
const JSDocState = {
  BeginningOfLine: 0,
  SawAsterisk: 1,
  SavingComments: 2,
}

@enum은 TypeScript의 enum 과는 꽤 다르며, 훨씬 단순하다는 점에 유의하세요. 그러나 TypeScript의 열거형과는 달리, @enum은 어떠한 타입이든 가질 수 있습니다:
/** @enum {function(number): number} */
const Math = {
  add1: n => n + 1,
  id: n => -n,
  sub1: n => n - 1,
}

다른 예제들 (More examples)
var someObj = {
  /**
   * @param {string} param1 - 프로퍼티 할당에 대한 Docs
   */
  x: function(param1){}
};

/**
 * 변수 할당에 대한 docs처럼
 * @return {Window}
 */
let someFunc = function(){};

/**
 * 클래스 메서드
 * @param {string} greeting 사용할 인사말
 */
Foo.prototype.sayHi = (greeting) => console.log("Hi!");

/**
 * 화살표 함수 표현
 * @param {number} x - A multiplier
 */
let myArrow = x => x * x;

/**
 * JSX의 무상태 함수 컴포넌트에서도 사용됨.
 * @param {{a: string, b: number}} test - Some param
 */
var fc = (test) => {test.a.charAt(0)};

/**
 * 클로저 구문을 사용하여, 매개변수가 클래스 생성자가 될 수 있음.
 *
 * @param {{new(...args: any[]): object}} C - 등록할 클래스
 */
function registerClass(C) {}

/**
 * @param {...string} p1 - A 'rest' arg (array) of strings. ('any'로 취급됨)
 */
function fn10(p1){}

/**
 * @param {...string} p1 - A 'rest' arg (array) of strings. ('any'로 취급됨)
 */
function fn9(p1) {
  return p1.join();
}

지원되지 않을 것으로 알려진 패턴들 (Patterns that are known NOT to be supported)
생성자 함수처럼, 값 공간(value space)에 있는 객체를 타입으로 참조하는 것은 객체가 타입을 생성하지 않는 한 작동하지 않습니다.
function aNormalFunction() {

}
/**
 * @type {aNormalFunction}
 */
var wrong;
/**
 * 'typeof' 대신 사용:
 * @type {typeof aNormalFunction}
 */
var right;

접미사는 객체 리터럴 유형의 프로퍼티 유형과 동일하며 선택적 프로퍼티를 지정하지 않습니다:
/**
 * @type {{ a: string, b: number= }}
 */
var wrong;
/**
 * 프로퍼티 이름에 물음표 접미사 사용
 * @type {{ a: string, b?: number }}
 */
var right;

Nullable 타입은 strictNullChecks이 활성화되어있는 때만 의미가 있습니다.
/**
 * @type {?number}
 * With strictNullChecks: true -- number | null
 * With strictNullChecks: off  -- number
 */
var nullable;

Nullable이 아닌 타입은 의미가 없으며 원래의 타입으로 취급됩니다:
/**
 * @type {!number}
 * 단순히 숫자 타입을 갖게 됨
 */
var normal;

JSDoc의 타입 시스템과는 다르게, TypeScript는 null 값을 포함하는지, 안 하는지에 대해서만 표시할 수 있습니다.
명시적인 non-nullability는 없습니다 -- strictNullChecks이 활성화되어 있다면, number는 nullable이 아닐 것입니다.
활성화되어있지 않다면, number는 nullable 일 것입니다.

pages/utility-types.html.body:
소개 (Introduction)
TypeScript는 공통 타입 변환을 용이하게 하기 위해 몇 가지 유틸리티 타입을 제공합니다. 이런 유틸리티들은 전역으로 사용 가능합니다.
목차 (Table of contents)

Partial
Readonly
Record
Pick
Omit
Exclude
Extract
NonNullable
Parameters
ConstructorParameters
ReturnType
InstanceType
Required
ThisParameterType
OmitThisParameter
ThisType

Partial
T의 모든 프로퍼티를 선택적으로 만드는 타입을 구성합니다. 이 유틸리티는 주어진 타입의 모든 하위 타입 집합을 나타내는 타입을 반환합니다.
예제 (Example)
interface Todo {
    title: string;
    description: string;
}

function updateTodo(todo: Todo, fieldsToUpdate: Partial) {
    return { ...todo, ...fieldsToUpdate };
}

const todo1 = {
    title: 'organize desk',
    description: 'clear clutter',
};

const todo2 = updateTodo(todo1, {
    description: 'throw out trash',
});

Readonly
T의 모든 프로퍼티를 읽기 전용(readonly)으로 설정한 타입을 구성합니다, 즉 생성된 타입의 프로퍼티는 재할당할 수 없습니다.
예제 (Example)
interface Todo {
    title: string;
}

const todo: Readonly = {
    title: 'Delete inactive users',
};

todo.title = 'Hello'; // 오류: 읽기 전용 프로퍼티에 재할당할 수 없음

이 유틸리티는 런타임에 실패할 할당 표현식을 나타낼 때 유용합니다.(예, frozen 객체의 프로퍼티에 재할당 하려고 하는 경우)
Object.freeze
function freeze(obj: T): Readonly;

Record
타입 T의 프로퍼티의 집합 K로 타입을 구성합니다. 이 유틸리티는 타입의 프로퍼티들을 다른 타입에 매핑시키는 데 사용될 수 있습니다.
예제 (Example)
interface PageInfo {
    title: string;
}

type Page = 'home' | 'about' | 'contact';

const x: Record = {
    about: { title: 'about' },
    contact: { title: 'contact' },
    home: { title: 'home' },
};

Pick
T에서 프로퍼티 K의 집합을 선택해 타입을 구성합니다.
예제 (Example)
interface Todo {
    title: string;
    description: string;
    completed: boolean;
}

type TodoPreview = Pick;

const todo: TodoPreview = {
    title: 'Clean room',
    completed: false,
};

Omit
T에서 모든 프로퍼티를 선택한 다음 K를 제거한 타입을 구성합니다.
예제 (Example)
interface Todo {
    title: string;
    description: string;
    completed: boolean;
}

type TodoPreview = Omit;

const todo: TodoPreview = {
    title: 'Clean room',
    completed: false,
};

Exclude
T에서 U에 할당할 수 있는 모든 속성을 제외한 타입을 구성합니다.
예제 (Example)
type T0 = Exclude;  // "b" | "c"
type T1 = Exclude;  // "c"
type T2 = Exclude void), Function>;  // string | number

Extract
T에서 U에 할당 할 수 있는 모든 속성을 추출하여 타입을 구성합니다.
예제 (Example)
type T0 = Extract;  // "a"
type T1 = Extract void), Function>;  // () => void

NonNullable
T에서 null 과 undefined를 제외한 타입을 구성합니다.
예제 (Example)
type T0 = NonNullable;  // string | number
type T1 = NonNullable;  // string[]

Parameters
함수 타입 T의 매개변수 타입들의 튜플 타입을 구성합니다.
예제 (Example)
declare function f1(arg: { a: number, b: string }): void
type T0 = Parameters string>;  // []
type T1 = Parameters void>;  // [string]
type T2 = Parameters(arg: T) => T)>;  // [unknown]
type T4 = Parameters;  // [{ a: number, b: string }]
type T5 = Parameters;  // unknown[]
type T6 = Parameters;  // never
type T7 = Parameters;  // 오류
type T8 = Parameters;  // 오류

ConstructorParameters
ConstructorParameters 타입은 생성자 함수 타입의 모든 매개변수 타입을 추출할 수 있게 해줍니다. 모든 매개변수 타입을 가지는 튜플 타입(T가 함수가 아닌 경우 never)을 생성합니다.
예제 (Example)
type T0 = ConstructorParameters;  // [(string | undefined)?]
type T1 = ConstructorParameters;  // string[]
type T2 = ConstructorParameters;  // [string, (string | undefined)?]

ReturnType
함수 T의 반환 타입으로 구성된 타입을 만듭니다.
예제 (Example)
declare function f1(): { a: number, b: string }
type T0 = ReturnType string>;  // string
type T1 = ReturnType void>;  // void
type T2 = ReturnType() => T)>;  // {}
type T3 = ReturnType() => T)>;  // number[]
type T4 = ReturnType;  // { a: number, b: string }
type T5 = ReturnType;  // any
type T6 = ReturnType;  // any
type T7 = ReturnType;  // 오류
type T8 = ReturnType;  // 오류

InstanceType
생성자 함수 타입 T의 인스턴스 타입으로 구성된 타입을 만듭니다.
Example
class C {
    x = 0;
    y = 0;
}

type T0 = InstanceType;  // C
type T1 = InstanceType;  // any
type T2 = InstanceType;  // any
type T3 = InstanceType;  // 오류
type T4 = InstanceType;  // 오류

Required
T의 모든 프로퍼티가 필수로 설정된 타입을 구성합니다.
예제 (Example)
interface Props {
    a?: number;
    b?: string;
};

const obj: Props = { a: 5 }; // 성공

const obj2: Required = { a: 5 }; // 오류: 프로퍼티 'b'가 없습니다

ThisParameterType
함수 타입의 this 매개변수의 타입, 혹은 함수 타입에 this 매개변수가 없을 경우 unknown을 추출합니다.
유의: 이 타입은 --strictFunctionTypes가 활성화되었을 때만 올바르게 동작합니다. #32964를 참고하세요.
예제 (Example)
function toHex(this: Number) {
    return this.toString(16);
}

function numberToString(n: ThisParameterType) {
    return toHex.apply(n);
}

OmitThisParameter
함수 타입에서 'this' 매개변수를 제거합니다.
유의: 이 타입은 --strictFunctionTypes가 활성화되었을 때만 올바르게 동작합니다. #32964를 참고하세요.
예제 (Example)
function toHex(this: Number) {
    return this.toString(16);
}

// `bind`의 반환 타입은 이미 `OmitThisParameter`을 사용하고 있습니다, 이는 단지 예제를 위한 것입니다.
const fiveToHex: OmitThisParameter = toHex.bind(5);

console.log(fiveToHex());

ThisType
이 유틸리티는 변형된 타입을 반환하지 않습니다. 대신, 문맥적 this타입에 표시하는 역할을 합니다. 이 유틸리티를 사용하기 위해선 --noImplicitThis 플래그를 사용해야 한다는 것을 유의하세요.
예제 (Example)
// --noImplicitThis 로 컴파일

type ObjectDescriptor = {
    data?: D;
    methods?: M & ThisType;  // 메서드 안의 'this 타입은 D & M 입니다.
}

function makeObject(desc: ObjectDescriptor): D & M {
    let data: object = desc.data || {};
    let methods: object = desc.methods || {};
    return { ...data, ...methods } as D & M;
}

let obj = makeObject({
    data: { x: 0, y: 0 },
    methods: {
        moveBy(dx: number, dy: number) {
            this.x += dx;  // 강하게 타입이 정해진 this
            this.y += dy;  // 강하게 타입이 정해진 this
        }
    }
});

obj.x = 10;
obj.y = 20;
obj.moveBy(5, 5);

위 예제에서, makeObject의 인자로 넘겨지는 methods 객체는 ThisType를 포함한 문맥적 타입을 가지고 있고, 따라서 methods 객체의 메서드 안에 this 타입은{ x: number, y: number } & { moveBy(dx: number, dy: number): number }입니다. method 프로퍼티의 타입이 추론의 대상이며 동시에 메서드 안의 this 타입의 출처인 것을 주목하세요.
ThisType 마커 인터페이스는 단지 lib.d.ts에 선언된 빈 인터페이스입니다. 객체 리터럴의 문맥적 타입으로 인식되는 것을 넘어, 그 인터페이스는 빈 인터페이스처럼 동작합니다.

pages/declaration-files/library-structur.body:
개요 (Overview)
일반적으로, 선언 파일을 구조화하는 방법은 라이브러리를 사용하는 방법에 따라 다릅니다.
JavaScript에서 사용할 라이브러리를 제공하는 방법은 여러 가지가 있고, 이에 맞추어 선언 파일을 작성해야 합니다.
이 가이드는 일반적인 라이브러리 패턴을 식별하는 방법과, 그 패턴에 상응하는 선언 파일을 작성하는 방법에 대해 다룹니다.
주요 라이브러리 각각의 구조화 패턴 유형은 템플릿 섹션에 있습니다.
이 템플릿으로 시작하면 더 빠르게 진행할 수 있습니다.
라이브러리 종류 식별하기 (Identifying Kinds of Libraries)
첫 번째로, TypeScript 선언 파일이 나타낼 수 있는 라이브러리 종류를 다뤄보겠습니다.
각 종류의 라이브러리를 사용하는 방법과, 작성하는 방법, 그리고 실제 라이브러리들의 예제를 볼 것입니다.
라이브러리의 구조를 식별하는 것은 선언 파일을 작성하는 첫 단계입니다.
사용법과 코드를 기반으로 구조를 식별하는 방법에 대한 힌트를 제공합니다.
라이브러리의 문서와 구성에 따라서, 어떤 건 다른 것보다 훨씬 쉬울 수 있습니다.
본인에게 더 편한 것을 사용할 것을 추천합니다.
전역 라이브러리 (Global Libraries)
전역 라이브러리는 전역 스코프 (즉, import 형식을 사용하지 않음)에서 접근 가능한 라이브러리입니다.
많은 라이브러리는 사용을 위해 간단히 하나 이상의 전역 변수를 노출합니다.
예를 들어, jQuery를 사용한다면, $ 변수를 참조해서 사용할 수 있습니다:
$(() => { console.log('hello!'); } );

HTML 스크립트 태그로 라이브러리를 사용하는 방법은 라이브러리 문서에서 지침을 볼 수 있습니다:


오늘날, 대부분의 전역에서 접근 가능한 유명 라이브러리들은 실제로 UMD 라이브러리로 작성되어 있습니다 (아래를 참조).
UMD 라이브러리 문서는 전역 라이브러리 문서와 구별하기 어렵습니다.
전역 선언 파일을 작성하기 전에, 실제로는 UMD가 아닌지 확인하십시오.
코드에서 전역 라이브러리 식별하기 (Identifying a Global Library from Code)
전역 라이브러리 코드는 대게 엄청 간단합니다.
전역 "Hello, world" 라이브러리는 다음과 같습니다:
function createGreeting(s) {
    return "Hello, " + s;
}

혹은 다음과 같습니다:
window.createGreeting = function(s) {
    return "Hello, " + s;
}

전역 라이브러리의 코드를 보면, 보통 다음을 볼 수 있습니다:

최상위 레벨 var문 이나 function선언
하나 이상의 window.someName 할당
DOM 인터페이스 document 혹은 window가 존재한다고 가정

다음은 볼 수 없습니다:

require 이나 define 같은 모듈 로더 검사 혹은 사용
var fs = require("fs"); 형태의 CommonJS/Node.js-스타일 import
define(...) 호출
라이브러리를 require 혹은 import하는 방법에 대해 설명하는 문서

전역 라이브러리 예제 (Examples of Global Libraries)
전역 라이브러리를 UMD 라이브러리로 바꾸는게 쉽기 때문에, 전역 스타일로 작성한 인기 라이브러리는 거의 없습니다.
하지만, 크기가 작고 DOM이 필요한 (혹은 의존성이 없는) 라이브러리는 여전히 전역입니다.
전역 라이브러리 템플릿 (Global Library Template)
템플릿 파일 global.d.ts은 예제 라이브러리 myLib를 정의합니다.
"이름 충돌 방지" 각주를 반드시 읽어보세요.
모듈형 라이브러리 (Modular Libraries)
어떤 라이브러리는 모듈 로더 환경에서만 동작합니다.
예를 들어, express는 Node.js에서만 동작하고 반드시 CommonJS의 require 함수로 로드되어야 합니다.
ECMAScript 2015 (ES2015, ECMAScript 6, ES6로도 잘 알려진), CommonJS와 RequireJS는 모듈을 importing하는 비슷한 개념을 가지고 있습니다.
JavaScript의 CommonJS (Node.js)를 예를 들면, 다음과 같이 작성합니다
var fs = require("fs");

TypeScript나 ES6에서는, import 키워드가 같은 목적을 제공합니다:
import fs = require("fs");

일반적으로 모듈형 라이브러리의 문서에서 다음 코드들 중 하나를 볼 수 있습니다:
var someLib = require('someLib');

혹은
define(..., ['someLib'], function(someLib) {

});

전역 모듈과 마찬가지로 UMD 모듈의 문서에서도 이 예제들을 볼 수 있으므로, 코드나 문서를 반드시 확인하세요.
코드에서 모듈 라이브러리 식별하기 (Identifying a Module Library from Code)
모듈형 라이브러리는 일반적으로 다음 중 몇 가지를 반드시 가지고 있습니다:

require 혹은 define에 대한 무조건적인 호출
import * as a from 'b'; 혹은 export c; 같은 선언문
exports 혹은 module.exports에 대한 할당

다음은 거의 갖지 않습니다:

window 혹은 global 프로퍼티 할당

모듈형 라이브러리 예제 (Examples of Modular Libraries)
많은 유명한 Node.js 라이브러리들은 express, gulp, request와 같은 모듈군 안에 있습니다.
UMD
UMD 모듈은 모듈로 (import를 통해) 사용할 수 있고 혹은 전역으로도 (모듈 로더 없는 환경에서 실행될 때) 사용할 수 있습니다.
Moment.js 같은 많은 유명한 라이브러리들은 이 방법으로 작성되었습니다.
예를 들어, Node.js나 RequireJS를 사용하면, 다음과 같이 작성합니다:
import moment = require("moment");
console.log(moment.format());

반면 바닐라 브라우저 환경에서는 다음과 같이 쓸 수 있습니다:
console.log(moment.format());

UMD 라이브러리 식별하기 (Identifying a UMD library)
UMD modules은 모듈 로더 환경 유무를 검사합니다.
이는 다음과 같이 보이는 찾기 쉬운 패턴입니다:
(function (root, factory) {
    if (typeof define === "function" && define.amd) {
        define(["libName"], factory);
    } else if (typeof module === "object" && module.exports) {
        module.exports = factory(require("libName"));
    } else {
        root.returnExports = factory(root.libName);
    }
}(this, function (b) {

만약 라이브러리 코드, 특히 파일 상단에서 typeof define, typeof window 혹은 typeof module에 대한 테스트를 보았다면, 거의 대부분 UMD 라이브러리입니다.
UMD 라이브러리 문서에서는 require를 보여주는 "Node.js에서 사용하기" 예제를 종종 설명하고
  "브라우저에서 사용하기" 예제에서는  태그를 사용해서 스크립트를 로드하는 방법을 보여줍니다.
UMD 라이브러리 예제 (Examples of UMD libraries)
유명한 라이브러리 대부분은 UMD 패키지로 사용할 수 있습니다.
예로는 jQuery, Moment.js, loadash 등 더 많이 있습니다.
템플릿 (Template)
모듈은 세 가지 템플릿을 사용할 수 있습니다,
  module.d.ts, module-class.d.ts 그리고 module-function.d.ts.
만약 모듈을 함수처럼 호출할 수 있으면 module-function.d.ts을 사용하세요:
var x = require("foo");
// 참고: 함수로 'x'를 호출
var y = x(42);

각주 "ES6가 모듈 호출 시그니처에 미치는 영향"를 반드시 읽어보세요
만약 모듈이 new를 사용하여 생성할 수 있다면 module-class.d.ts를 사용하세요:
var x = require("bar");
// 참고: 'new' 연산자를 import된 변수에 사용
var y = new x("hello");

이런 모듈에도 같은 각주가 적용됩니다.
만약 모듈이 위 사항에 해당되지 않다면, module.d.ts 파일을 사용하세요.
모듈 플러그인 혹은 UMD 플러그인 (Module Plugin or UMD Plugin)
모듈 플러그인은 다른 모듈 (UMD나 모듈)의 형태를 변경합니다.
예를 들어, Moment.js에서, moment-range는 moment 객체에 새로운 range 메서드를 추가합니다.
선언 파일 작성을 위해, 모듈이 일반 모듈로 변경되든 UMD 모듈로 변경되든 같은 코드를 작성합니다.
템플릿 (Template)
module-plugin.d.ts 템플릿을 사용하세요.
Global Plugin
A global plugin is global code that changes the shape of some global.
As with global-modifying modules, these raise the possibility of runtime conflict.
For example, some libraries add new functions to Array.prototype or String.prototype.
Identifying global plugins
Global plugins are generally easy to identify from their documentation.
You'll see examples that look like this:
var x = "hello, world";
// Creates new methods on built-in types
console.log(x.startsWithHello());

var y = [1, 2, 3];
// Creates new methods on built-in types
console.log(y.reverseAndSort());

Template
Use the global-plugin.d.ts template.
Global-modifying Modules
A global-modifying module alters existing values in the global scope when they are imported.
For example, there might exist a library which adds new members to String.prototype when imported.
This pattern is somewhat dangerous due to the possibility of runtime conflicts,
  but we can still write a declaration file for it.
Identifying global-modifying modules
Global-modifying modules are generally easy to identify from their documentation.
In general, they're similar to global plugins, but need a require call to activate their effects.
You might see documentation like this:
// 'require' call that doesn't use its return value
var unused = require("magic-string-time");
/* or */
require("magic-string-time");

var x = "hello, world";
// Creates new methods on built-in types
console.log(x.startsWithHello());

var y = [1, 2, 3];
// Creates new methods on built-in types
console.log(y.reverseAndSort());

Template
Use the global-modifying-module.d.ts template.
Consuming Dependencies
There are several kinds of dependencies your library might have.
This section shows how to import them into the declaration file.
Dependencies on Global Libraries
If your library depends on a global library, use a ///  directive:
/// 

function getThing(): someLib.thing;

Dependencies on Modules
If your library depends on a module, use an import statement:
import * as moment from "moment";

function getThing(): moment;

Dependencies on UMD libraries
From a Global Library
If your global library depends on a UMD module, use a ///  directive:
/// 

function getThing(): moment;

From a Module or UMD Library
If your module or UMD library depends on a UMD library, use an import statement:
import * as someLib from 'someLib';

Do not use a ///  directive to declare a dependency to a UMD library!
Footnotes
Preventing Name Conflicts
Note that it's possible to define many types in the global scope when writing a global declaration file.
We strongly discourage this as it leads to possible unresolvable name conflicts when many declaration files are in a project.
A simple rule to follow is to only declare types namespaced by whatever global variable the library defines.
For example, if the library defines the global value 'cats', you should write
declare namespace cats {
    interface KittySettings { }
}

But not
// at top-level
interface CatsKittySettings { }

This guidance also ensures that the library can be transitioned to UMD without breaking declaration file users.
The Impact of ES6 on Module Plugins
Some plugins add or modify top-level exports on existing modules.
While this is legal in CommonJS and other loaders, ES6 modules are considered immutable and this pattern will not be possible.
Because TypeScript is loader-agnostic, there is no compile-time enforcement of this policy, but developers intending to transition to an ES6 module loader should be aware of this.
The Impact of ES6 on Module Call Signatures
Many popular libraries, such as Express, expose themselves as a callable function when imported.
For example, the typical Express usage looks like this:
import exp = require("express");
var app = exp();

In ES6 module loaders, the top-level object (here imported as exp) can only have properties;
  the top-level module object is never callable.
The most common solution here is to define a default export for a callable/constructable object;
  some module loader shims will automatically detect this situation and replace the top-level object with the default export.
Library file layout
The layout of your declaration files should mirror the layout of the library.
A library can consist of multiple modules, such as
myLib
  +---- index.js
  +---- foo.js
  +---- bar
         +---- index.js
         +---- baz.js

These could be imported as
var a = require("myLib");
var b = require("myLib/foo");
var c = require("myLib/bar");
var d = require("myLib/bar/baz");

Your declaration files should thus be
@types/myLib
  +---- index.d.ts
  +---- foo.d.ts
  +---- bar
         +---- index.d.ts
         +---- baz.d.ts

pages/declaration-files/by-example.html.body:
소개 (Introduction)
이 가이드는 양질의 선언 파일을 작성하는 방법을 설명하기 위해 작성되었습니다.
이 가이드는 일부 API 문서를 해당 API 사용 예시와 함께 보여주고,
  상응하는 선언을 작성하는 방법을 설명합니다.
예제는 대체로 후반부로 갈수록 복잡해집니다.

전역 변수 (Global Variables)
전역 함수 (Global Functions)
프로퍼티를 갖는 객체 (Objects with Properties)
오버로드된 함수 (Overloaded Function)
재사용 가능한 타입 (인터페이스) (Reusable Types (Interfaces))
재사용 가능한 타입 (타입 별칭) (Reusable Types (Type Aliases))
타입 구조화하기 (Organizing Types)
클래스 (Classes)

예제 (The Examples)
전역 변수 (Global Variables)
문서

전역 변수 foo는 존재하는 위젯의 수를 포함합니다.

코드
console.log("Half the number of widgets is " + (foo / 2));

선언
변수를 선언하기 위해 declare var를 사용하세요.
만약 변수가 읽기-전용이라면, declare const를 사용하세요.
변수가 블록-스코프인 경우 declare let 또한 사용할 수 있습니다.
/** 존재하는 위젯의 수 */
declare var foo: number;

전역 함수 (Global Functions)
문서

사용자에게 인사말을 보여주기 위해 greet 함수를 호출할 수 있습니다.

코드
greet("hello, world");

선언
함수를 선언하기 위해 declare function을 사용하세요.
declare function greet(greeting: string): void;

프로퍼티를 갖는 객체 (Objects with Properties)
문서

전역 변수 myLib에는 인사말을 만드는 함수 makeGreeting와,
지금까지 생성한 인사말의 수를 가리키는 numberOfGreetings 프로퍼티가 있습니다.

코드
let result = myLib.makeGreeting("hello, world");
console.log("The computed greeting is:" + result);

let count = myLib.numberOfGreetings;

선언
점 표기법으로 접근하는 타입이나 값을 설명하기 위해 declare namespace를 사용하세요.
declare namespace myLib {
    function makeGreeting(s: string): string;
    let numberOfGreetings: number;
}

오버로드된 함수 (Overloaded Functions)
문서
getWidget 함수는 숫자를 인자로 받아 Widget을 반환하거나, 문자열을 인자로 받아 Widget 배열을 반환합니다.
코드
let x: Widget = getWidget(43);

let arr: Widget[] = getWidget("all of them");

선언
declare function getWidget(n: number): Widget;
declare function getWidget(s: string): Widget[];

재사용 가능한 타입 (인터페이스) (Reusable Types (Interfaces))
문서

greeting을 명시할 때, 반드시 GreetingSettings 객체를 전달해야 합니다.
이 객체는 다음의 프로퍼티를 갖고 있습니다:
1 - greeting: 필수 문자열
2 - duration: 선택적 시간 (밀리초)
3 - color: 선택적 문자열, 예. '#ff00ff'

코드
greet({
  greeting: "hello world",
  duration: 4000
});

선언
프로퍼티를 갖는 타입을 정의하기 위해 interface를 사용하세요.
interface GreetingSettings {
  greeting: string;
  duration?: number;
  color?: string;
}

declare function greet(setting: GreetingSettings): void;

재사용 가능한 타입 (타입 별칭) (Reusable Types (Type Aliases))
문서

인사말이 예상되는 어느 곳에나, string, string을 반환하는 함수, 또는 Greeter 인스턴스를 전달할 수 있습니다.

코드
function getGreeting() {
    return "howdy";
}
class MyGreeter extends Greeter { }

greet("hello");
greet(getGreeting);
greet(new MyGreeter());

선언
타입에 대한 약칭으로 타입 별칭을 사용할 수 있습니다:
type GreetingLike = string | (() => string) | Greeter;

declare function greet(g: GreetingLike): void;

타입 구조화하기 (Organizing Types)
문서

greeter 객체는 파일에 로그를 작성하거나 경고 창을 띄울 수 있습니다.
로그 옵션을 .log(...) 내부에, 경고 창 옵션을 .alert(...) 내부에 전달할 수 있습니다.

코드
const g = new Greeter("Hello");
g.log({ verbose: true });
g.alert({ modal: false, title: "Current Greeting" });

선언
타입을 구조화하기 위해 네임스페이스를 사용하세요.
declare namespace GreetingLib {
    interface LogOptions {
        verbose?: boolean;
    }
    interface AlertOptions {
        modal: boolean;
        title?: string;
        color?: string;
    }
}

중첩된 네임스페이스를 하나의 선언으로 만들 수 있습니다:
declare namespace GreetingLib.Options {
    // Refer to via GreetingLib.Options.Log
    interface Log {
        verbose?: boolean;
    }
    interface Alert {
        modal: boolean;
        title?: string;
        color?: string;
    }
}

클래스 (Classes)
문서

Greeter 객체를 인스턴스화해서 greeter를 생성하거나, 이 객체를 상속해서 커스텀 greeter를 생성할 수 있습니다.

코드
const myGreeter = new Greeter("hello, world");
myGreeter.greeting = "howdy";
myGreeter.showGreeting();

class SpecialGreeter extends Greeter {
    constructor() {
        super("Very special greetings");
    }
}

선언
클래스 혹은 클래스-같은 객체를 설명하기 위해 declare class를 사용하세요.
클래스는 생성자 뿐만 아니라 프로퍼티와 메서드를 가질 수 있습니다.
declare class Greeter {
    constructor(greeting: string);

    greeting: string;
    showGreeting(): void;
}



