pages/declaration-files/dos-and-don-ts.h.body:
일반 타입 (General Types)
Number, String, Boolean, Symbol and Object
Number, String, Boolean, Symbol, Object 타입을 사용하지 마세요.
이 타입들은 JavaScript 코드에서 거의 사용되지 않는 비-원시형 박싱된 객체를 가르킵니다.
/* 잘못됨 */
function reverse(s: String): String;

number, string, boolean, symbol 타입을 사용 하세요.
/* 좋음 */
function reverse(s: string): string;

Object 대신에, TypeScript 2.2 에 추가된 비-원시형 object타입을 사용하세요.
제네릭 (Generics)
타입 매개변수를 사용하지 않는 제네릭 타입을 사용하지 마세요. 더 자세한 내용은 TypeScript FAQ 페이지에서 확인하세요.

콜백 타입 (Callback Types)
콜백의 반환 타입 (Return Types of Callbacks)

사용하지 않는 콜백의 반환 값 타입에 any를 사용하지 마세요:
/* 잘못됨 */
function fn(x: () => any) {
    x();
}

사용하지 않는 콜백의 반환 값 타입은 void를 사용하세요:  
/* 좋음 */
function fn(x: () => void) {
    x();
}

이유: void를 사용하면 실수로 x의 반환 값을 사용하는 것을 방지 할 수 있기 때문에 더 안전합니다.:
function fn(x: () => void) {
    var k = x(); // oops! meant to do something else
    k.doSomething(); // error, but would be OK if the return type had been 'any'
}

콜백에서 선택적 매개변수 (Optional Parameters in Callbacks)
정말 의도한 것이 아니라면 콜백에 선택적 매개변수를 사용하지 마세요:
/* 잘못됨 */
interface Fetcher {
    getObject(done: (data: any, elapsedTime?: number) => void): void;
}

이는 아주 구체적인 의미를 가지고 있습니다: done 콜백은 1개 혹은 2개의 인자로 호출될 수 있습니다.
작성자는 아마 elapsedTime 매개변수가 콜백에 상관없다는 것을 말하려는 의도였을 것입니다,
  하지만 이를 위해 매개변수를 선택적으로 만들 필요는 없습니다 --
  콜백에 더 적은 인수를 제공하는 것은 항상 허용됩니다.
콜백 매개변수를 비-선택적으로 작성하세요:
/* 좋음 */
interface Fetcher {
    getObject(done: (data: any, elapsedTime: number) => void): void;
}

오버로드와 콜백 (Overloads and Callbacks)
콜백의 인수만 다른 오버로드를 분리해서 작성 하지 마세요:
/* 잘못됨 */
declare function beforeAll(action: () => void, timeout?: number): void;
declare function beforeAll(action: (done: DoneFn) => void, timeout?: number): void;

최대 인수를 사용해 하나의 오버로드를 작성 하세요:
/* 좋음 */
declare function beforeAll(action: (done: DoneFn) => void, timeout?: number): void;

이유: 콜백이 매개변수를 무시하는 것은 항상 허용되므로, 짧은 오버로드는 필요하지 않습니다.
더 짧은 콜백을 먼저 작성하면 넘어오는 함수가 첫 번째 오버로드와 일치하기 때문에 잘못된-타입의 함수를 허용합니다.
함수 오버로드 (Function Overloads)
순서 (Ordering)
더 일반적인 오버로드를 더 구체적인 오버로드 이전에 두지 마세요:
/* 잘못됨 */
declare function fn(x: any): any;
declare function fn(x: HTMLElement): number;
declare function fn(x: HTMLDivElement): string;

var myElem: HTMLDivElement;
var x = fn(myElem); // x: any, wat?

구체적인 오버로드 뒤에 일반적인 오버로드가 위치하게 정렬 하세요:
/* 좋음 */
declare function fn(x: HTMLDivElement): string;
declare function fn(x: HTMLElement): number;
declare function fn(x: any): any;

var myElem: HTMLDivElement;
var x = fn(myElem); // x: string, :)

이유: TypeScript는 함수 호출을 처리할 때 첫 번째로 일치하는 오버로드를 선택합니다.
이전의 오버로드가 뒤에 것보다 "더 구체적"이면, 뒤에 것은 사실상 가려져 호출되지 않습니다.
선택적 매개변수 사용 (Use Optional Parameters)
뒤따라오는 매개변수만 다른 오버로드를 작성하지 마세요:
/* 잘못됨 */
interface Example {
    diff(one: string): number;
    diff(one: string, two: string): number;
    diff(one: string, two: string, three: boolean): number;
}

가능한 선택적 매개변수를 사용 하세요:
/* 좋음 */
interface Example {
    diff(one: string, two?: string, three?: boolean): number;
}

이 문제는 모든 오버로드가 같은 반환 타입을 가질 때만 발생한다는 점에 유의하세요.
이유: 두 가지 중요한 이유가 있습니다.
TypeScript는 소스의 인수로 대상의 시그니처를 호출할 수 있는지 확인하여 시그니처 호환성을 결정합니다.
  그리고 관계없는 인수가 허용됩니다
예를 들어, 이 코드는 선택적 매개변수를 사용하여 올바르게 작성된 경우에만 버그를 노출합니다:
function fn(x: (a: string, b: number, c: number) => void) { }
var x: Example;
// 오버로드로 작성한 경우, OK -- 첫번째 오버로드가 사용됨
// 선택적으로 작성한 경우, 올바르게 오류.
fn(x.diff);

두 번째 이유는 사용자가 TypeScript의 "strict null checking" 기능을 사용할 때입니다.
JavaScript에서 지정되지 않은 매개변수는 undefined로 나타나기 때문에, 일반적으로 선택적 매개변수가 있는 함수에 명시적으로 undefined를 전달하는 것이 좋습니다.
예를 들어, 이 코드는, strict null에서 문제없습니다.
var x: Example;
// 오버로드로 작성한 경우, `undefined`를 `string` 에 전달했기 때문에 잘못된 에러
// 선택적으로 작성한 경우, 올바름
x.diff("something", true ? undefined : "hour");

유니언 타입 사용 (Use Union Types)
한 인수 위치에서 타입만 다른 오버로드를 사용하지 마세요:
/* 잘못됨 */
interface Moment {
    utcOffset(): number;
    utcOffset(b: number): Moment;
    utcOffset(b: string): Moment;
}

가능한 유니언 타입을 사용 하세요:
/* 좋음 */
interface Moment {
    utcOffset(): number;
    utcOffset(b: number|string): Moment;
}

시그니처의 반환 타입이 다르기 때문에 b를 선택적으로 만들지 않은 점에 유의하세요.
이유: 이는 함수에 값을 "전달하는" 사람들에게 중요합니다.:
function fn(x: string): void;
function fn(x: number): void;
function fn(x: number|string) {
    // 분리된 오버로드로 작성된 경우, 잘못된 에러
    // 유니언 타입으로 작성된 경우, 올바름
    return moment().utcOffset(x);
}

pages/declaration-files/deep-dive.html.body:
정의 파일 이론: 심층 분석 (Definition File Theory: A Deep Dive)
원하는 API 형태를 제공하는 모듈을 만드는 것은 까다로울 수 있습니다.
예를 들어, new의 사용에 따라 호출할 때 다른 타입을 생성하는 모듈을 원할 수 있고,
  계층에 노출 된 다양한 명명된 타입을 가지고 있으며,
  모듈 객체에 대한 여러 프로퍼티도 가질 수 있습니다.
이 가이드에서는, 익숙한 API를 노출하는 복잡한 정의 파일에 대해 작성하는 도구를 제공합니다.
또한 옵션이 다양하기 때문에 여기서는 모듈 (또는 UMD) 라이브러리에 중점을 둡니다.
주요 컨셉 (Key Concepts)
TypeScript 작동 방식에 대해 여러 주요 개념을 이해하여
  정의의 형태를 만드는 방법을 완전히 이해할 수 있습니다.
타입 (Types)
이 가이드를 읽고 있다면, 아마도 TypeScript의 타입에 대해 이미 알고 있을 것입니다.
보다 명확하게하기 위해, 다음과 같이 타입이 도입됩니다:

타입 별칭 선언 (type sn = number | string;)
인터페이스 선언 (interface I { x: number[]; })
클래스 선언 (class C { })
열거형 선언 (enum E { A, B, C })
타입을 가리키는 import 선언

이러한 각 선언 형태는 새로운 타입 이름을 만듭니다.
값 (Values)
타입과 마찬가지로 값이 무엇인지 이미 알고 있을 것입니다.
값은 표현식에서 참조할 수 있는 런타임 이름입니다.
예를 들어 let x = 5;에서는 x라고 불리는 값을 생성합니다.
다시 명확하게 말하자면, 다음과 같이 값을 만듭니다:

let, const, 그리고 var 선언
값을 포함하는 네임스페이스 또는 모듈 선언
열거형 선언
클래스 선언
값을 참조하는 import 선언
함수 선언

네임스페이스 (Namespaces)
타입은 네임스페이스 안에 존재할 수 있습니다.
예를 들어, let x: A.B.C 이란 선언이 있다면,
  타입 C는 A.B 네임스페이스에서 온 것 입니다.
이 구별은 미묘하지만 중요합니다 -- 여기서 A.B는 타입이거나 값일 필요는 없습니다.
간단한 조합: 하나의 이름, 여러 의미 (Simple Combinations: One name, multiple meanings)
A라는 이름이 있으면, A에 대해 타입, 값 또는 네임스페이스라는 세 가지 다른 의미를 찾을 수 있습니다.
이름을 해석하는 방법은 사용하는 컨텍스트에 따라 다릅니다.
예를 들어 let m: A.A = A; 선언에서,
  A는 먼저 네임스페이스로 사용 된 다음, 타입의 이름으로, 그 다음 값으로 사용됩니다.
즉 완전히 다른 선언을 의미할 수 있습니다!
약간은 혼란스러워 보이지만, 과하게 사용하지 않는 한 실제로 매우 편리합니다.
결합 동작의 유용한 측면을 살펴 보겠습니다.
내부 조합 (Built-in Combinations)
영리한 사람이라면, 타입과 값 목록에서 클래스가 둘 다 나온 것을 눈치챘을 것입니다.
class C { } 선언은 두 가지를 만듭니다:
  클래스 인스턴스의 형태를 나타내는 타입 C와
  클래스 생성자를 나타내는 값 C 입니다.
열거형 선언도 비슷하게 동작합니다.
사용자 조합 (User Combinations)
모듈 파일 foo.d.ts을 작성했습니다:
export var SomeVar: { a: SomeType };
export interface SomeType {
  count: number;
}

그 다음 사용했습니다:
import * as foo from './foo';
let x: foo.SomeType = foo.SomeVar.a;
console.log(x.count);

잘 작동하지만, SomeType과 SomeVar는 이름이 같도록
  밀접하게 관련되어 있다고 상상할 수 있습니다.
결합을 사용하여 같은 이름 Bar로 두 가지 다른 객체 (값과 타입)를 표시 할 수 있습니다:
export var Bar: { a: Bar };
export interface Bar {
  count: number;
}

이 경우 사용하는 코드를 구조 분해할 수 있는 아주 좋은 기회입니다:
import { Bar } from './foo';
let x: Bar = Bar.a;
console.log(x.count);

여기서도 Bar를 타입과 값으로 사용했습니다.
Bar 값을 Bar 타입으로 선언할 필요가 없다는 점을 유의하세요 -- 저 둘은 독립적입니다.
고급 결합 (Advanced Combinations)
선언은 여러 개의 선언에 걸쳐 결합될 수 있습니다.
예를 들어, class C { }와 interface C { } 같이 결합할 수 있으며 둘 다 C 타입에 프로퍼티를 추가합니다.
충돌을 일으키지 않는다면 충분히 합법적입니다.
일반적인 경험 법칙은 값의 이름이 네임스페이스로 선언되지 않는 한 항상 같은 이름의 다른 값과 충돌하고,
  타입 별칭 선언(type s = string)으로 선언 된 경우 타입이 충돌하며,
  네임스페이스와는 절대로 충돌하지 않는 것입니다.
어떻게 사용되는지 살펴보겠습니다.
인터페이스를 사용하여 추가하기 (Adding using an interface)
인터페이스에 다른 인터페이스 선언을 사용하여 멤버를 추가할 수 있습니다:
interface Foo {
  x: number;
}
// ... 다른 위치 ...
interface Foo {
  y: number;
}
let a: Foo = ...;
console.log(a.x + a.y); // 성공

클래스와도 같이 동작합니다:
class Foo {
  x: number;
}
// ... 다른 위치 ...
interface Foo {
  y: number;
}
let a: Foo = ...;
console.log(a.x + a.y); // 성공

단, 타입 별칭 (type s = string;)에는 인터페이스를 사용해서 추가할 수 없습니다.
네임스페이스를 사용하여 추가하기 (Adding using a namespace)
네임스페이스 선언은 충돌을 일으키지 않는 방식으로 새로운 타입, 값 그리고 네임스페이스를 추가할 수 있습니다.
예를 들어, 클래스에 정적 멤버를 추가할 수 있습니다:
class C {
}
// ... 다른 위치 ...
namespace C {
  export let x: number;
}
let y = C.x; // 성공

위 예제에서 C의 정적 측면(생성자 함수)에 값을 추가했습니다.
값을 추가 했고 모든 값에 대한 컨테이너가 다르기 때문입니다.
  (타입은 네임스페이스에 포함되고 네임스페이스는 다른 네임스페이스에 포함됩니다).
네임스페이스 타입을 클래스에 추가할 수 있습니다:
class C {
}
// ... 다른 위치 ...
namespace C {
  export interface D { }
}
let y: C.D; // 성공

이 예제에서 namespace 선언을 작성할 때까지 네임스페이스 C는 없었습니다.
네임스페이스 C는 클래스에 의해 생성된 C의 값 또는 타입과 충돌하지 않습니다.
마지막으로 namespace 선언을 사용하여 다양한 병합을 할 수 있습니다.
특히 현실적인 예는 아니지만, 흥미로운 동작을 확인할 수 있습니다:
namespace X {
  export interface Y { }
  export class Z { }
}

// ... 다른 위치 ...
namespace X {
  export var Y: number;
  export namespace Z {
    export class C { }
  }
}
type X = string;

위 예제에서 첫 번째 블록은 다음 이름의 의미를 만듭니다:

값 X (네임스페이스 선언은 값 Z를 포함하기 때문입니다)
네임스페이스 X (네임스페이스 선언은 타입 Y를 포함하기 때문입니다)
X 네임스페이스 안의 타입 Y
X 네임스페이스 안의 타입 Z (클래스의 인스턴스 형태)
X 값의 프로퍼티인 값 Z (클래스의 생성자 함수)

두 번째 블록은 다음 이름의 의미를 만듭니다:

X 값의 프로퍼티인 값 Y (number 타입)
네임스페이스 Z
X 값의 프로퍼티인 값 Z
X.Z 네임스페이스 안의 타입 C
X.Z 값의 프로퍼티인 값 C
타입 X

export = or import 사용하기 (Using with export = or import)
중요한 규칙은 export와 import 선언이 대상의 모든 의미 를 내보내거나 가져온다는 것 입니다.

pages/tutorials/typescript-in-5-minutes..body:
Typescript로 간단한 웹 애플리케이션을 만들어 보겠습니다.
TypeScript 설치하기 (Installing TypeScript)
TypeScript를 설치하는 방법에는 크게 두 가지가 있습니다:

npm을 이용한 설치 (Node.js 패키지 매니저)
TypeScript의 Visual Studio 플러그인 설치

Visual Studio 2017과 Visual Studio 2015 Update 3는 기본적으로 Typescript를 포함하고 있습니다.
만약 TypeScript를 Visual Studio과 함께 설치하지 않았다면 이곳에서 다운로드할 수 있습니다.
NPM 사용자의 경우:
> npm install -g typescript

첫 번째 TypeScript 파일 만들기 (Building your first TypeScript file)
에디터에서, greeter.ts 파일에 다음의 JavaScript 코드를 입력하세요:
function greeter(person) {
    return "Hello, " + person;
}

let user = "Jane User";

document.body.textContent = greeter(user);

코드 컴파일하기 (Compiling your code)
.ts 확장자를 사용했지만, 이 코드는 아직 일반 JavaScript 코드입니다.
기존의 JavaScript 앱에서 이 코드를 바로 복사하여 붙여 넣을 수 있습니다.
커맨드 라인에서 TypeScript 컴파일러를 실행하세요:
tsc greeter.ts

결과는 동일한 JavaScript 코드를 포함하고 있는 greeter.js 파일이 될 것입니다.
JavaScript 앱에서 TypeScript를 사용하여 시작했습니다!
이제 TypeScript가 제공하는 몇 가지 새로운 기능을 이용할 수 있습니다.
다음과 같이 : string 타입 표기를 'person' 함수의 인수에 추가하세요.
function greeter(person: string) {
    return "Hello, " + person;
}

let user = "Jane User";

document.body.textContent = greeter(user);

타입 표기 (Type annotations)
TypeScript의 타입 표기는 함수나 변수의 의도된 계약을 기록하는 간단한 방법입니다.
아래의 경우, greeter 함수를 단일 문자열 매개변수와 함께 호출하려고 합니다.
우리는 greeter 함수 호출 시 매개변수로 배열을 전달하도록 변경해 볼 수 있습니다:
function greeter(person: string) {
    return "Hello, " + person;
}

let user = [0, 1, 2];

document.body.textContent = greeter(user);

다시 컴파일하면, 오류가 발생한 것을 볼 수 있습니다:
error TS2345: Argument of type 'number[]' is not assignable to parameter of type 'string'.

마찬가지로, greeter 함수 호출에서 모든 인수를 제거해보세요.
TypeScript는 당신이 예상치 못한 개수의 매개변수로 이 함수를 호출했다는 것을 알려줄 것입니다.
두 경우 모두, TypeScript는 코드의 구조와 타입 표기에 기반해서 정적 분석을 제공합니다.
오류가 존재하기는 하지만, greeter.js 파일은 생성되었습니다.
코드에 오류가 존재하더라도 TypeScript를 사용할 수 있습니다. 그러나 TypeScript는 코드가 예상대로 작동하지 않을 것이라는 경고를 하게 됩니다.
인터페이스 (Interfaces)
예제를 더 발전시켜 보겠습니다. 여기서는 firstName 및 lastName 필드를 갖고 있는 객체를 나타내는 인터페이스를 사용합니다.
TypeScript에서, 내부 구조가 호환되는 두 타입은 서로 호환 됩니다.
그래서 명시적인 implements 절 없이, 인터페이스가 요구하는 형태를 사용하는 것만으로도 인터페이스를 구현할 수 있습니다.
interface Person {
    firstName: string;
    lastName: string;
}

function greeter(person: Person) {
    return "Hello, " + person.firstName + " " + person.lastName;
}

let user = { firstName: "Jane", lastName: "User" };

document.body.textContent = greeter(user);

클래스 (Classes)
마지막으로, 클래스를 사용하여 예제를 확장해 보겠습니다.
TypeScript는 클래스 기반 객체 지향 프로그래밍 지원과 같은 JavaScript의 새로운 기능을 지원합니다.
생성자와 public 필드를 사용해 Student 클래스를 만들겠습니다.
클래스와 인터페이스가 잘 작동하여, 프로그래머가 올바른 추상화 수준을 결정할 수 있게 해준다는 점을 주목하세요.
또한, 생성자의 인수에 public을 사용하는 것은 그 인수의 이름으로 프로퍼티를 자동으로 생성하는 축약형입니다.
class Student {
    fullName: string;
    constructor(public firstName: string, public middleInitial: string, public lastName: string) {
        this.fullName = firstName + " " + middleInitial + " " + lastName;
    }
}

interface Person {
    firstName: string;
    lastName: string;
}

function greeter(person: Person) {
    return "Hello, " + person.firstName + " " + person.lastName;
}

let user = new Student("Jane", "M.", "User");

document.body.textContent = greeter(user);

tsc greeter.ts를 재실행하면 생성된 JavaScript 코드가 이전의 코드와 동일하다는 것을 알 수 있습니다.
TypeScript의 클래스는 단지 JavaScript에서 자주 사용되는 프로토타입-기반 OO의 축약형일 뿐입니다.
TypeScript 웹 앱 실행하기 (Running your TypeScript web app)
이제 아래의 코드를 greeter.html에 작성하세요:


    TypeScript Greeter





브라우저에서 greeter.html을 열어 간단한 첫 번째 TypeScript 웹 앱을 실행해보세요!
옵션: Visual Studio에서 greeter.js를 열거나, TypeScript playground에 코드를 복사하세요.
식별자 위에 마우스를 올려놓으면 해당 타입을 볼 수 있습니다.
경우에 따라 타입이 자동으로 추론되기도 한다는 점을 유의하세요.
마지막 행을 다시 입력하고, DOM 요소 타입에 기반한 완료 목록과 매개변수 도움말을 확인하세요.
greeter 함수 참조 위에 커서를 올려놓고, F12 키를 눌러 해당 정의로 이동할 수 있습니다.
또한, 심벌을 마우스 오른쪽 버튼으로 클릭하고 리팩토링을 사용하여 이름을 바꿀 수 있습니다.
제공된 타입 정보는 애플리케이션 규모에서 JavaScript로 작동하는 도구와 함께 작동합니다.
TypeScript와 관련된 더 많은 예시를 보려면, 웹사이트의 Samples 섹션을 참고하세요.

pages/tutorials/ASP.NET-core.html.body:
ASP.NET Core + TypeScript
Setup
Install ASP.NET Core and TypeScript
First, install ASP.NET Core if you need it. This quick-start guide requires Visual Studio 2015 or 2017.
Next, if your version of Visual Studio does not already have the latest TypeScript, you can install it.
Create a new project


Choose File
Choose New Project (Ctrl + Shift + N)
Search for .NET Core in the project search bar
Select ASP.NET Core Web Application and press the Next button



Name your project and solution. After select the Create button



In the last window, select the Empty template and press the Create button


Run the application and make sure that it works.

Set up the server
Open Dependencies > Manage NuGet Packages > Browse. Search and install Microsoft.AspNetCore.StaticFiles and Microsoft.TypeScript.MSBuild:

Open up your Startup.cs file and edit your Configure function to look like this:
public void Configure(IApplicationBuilder app, IHostingEnvironment env)
{
    if (env.IsDevelopment())
    {
        app.UseDeveloperExceptionPage();
    }

    app.UseDefaultFiles();
    app.UseStaticFiles();
}

You may need to restart VS for the red squiggly lines below UseDefaultFiles and UseStaticFiles to disappear.
Add TypeScript
Next we will add a new folder and call it scripts.


Add TypeScript code
Right click on scripts and click New Item. Then choose TypeScript File and name the file app.ts

Add example code
Add the following code to the app.ts file.
function sayHello() {
    const compiler = (document.getElementById("compiler") as HTMLInputElement).value;
    const framework = (document.getElementById("framework") as HTMLInputElement).value;
    return `Hello from ${compiler} and ${framework}!`;
}

Set up the build
Configure the TypeScript compiler
First we need to tell TypeScript how to build. Right click on scripts and click New Item. Then choose TypeScript Configuration File and use the default name of tsconfig.json

Replace the contents of the tsconfig.json file with:
{
  "compilerOptions": {
    "noEmitOnError": true,
    "noImplicitAny": true,
    "sourceMap": true,
    "target": "es6"
  },
  "files": [
    "./app.ts"
  ],
  "compileOnSave": true
}


onEmitOnError : Do not emit outputs if any errors were reported.
noImplicitAny : Raise error on expressions and declarations with an implied any type.
sourceMap : Generates corresponding .map file.
target : Specify ECMAScript target version.

Note: "ESNext" targets latest supported
"noImplicitAny" is good idea whenever you’re writing new code — you can make sure that you don’t write any untyped code by mistake. "compileOnSave" makes it easy to update your code in a running web app.
Set up NPM #
We need to setup NPM so that JavaScript packages can be downloaded. Right click on the project and select New Item. Then choose NPM Configuration File and use the default name of package.json.

Inside the "devDependencies" section of the package.json file, add gulp and del
"devDependencies": {
    "gulp": "4.0.2",
    "del": "5.1.0"
}

Visual Studio should start installing gulp and del as soon as you save the file. If not, right-click package.json and then Restore Packages.
After you should see an npm folder in your solution explorer

Set up gulp #
Right click on the project and click New Item. Then choose JavaScript File and use the name of gulpfile.js
/// 
/*
This file is the main entry point for defining Gulp tasks and using Gulp plugins.
Click here to learn more. http://go.microsoft.com/fwlink/?LinkId=518007
*/

var gulp = require('gulp');
var del = require('del');

var paths = {
    scripts: ['scripts/**/*.js', 'scripts/**/*.ts', 'scripts/**/*.map'],
};

gulp.task('clean', function () {
    return del(['wwwroot/scripts/**/*']);
});

gulp.task('default', function () {
    gulp.src(paths.scripts).pipe(gulp.dest('wwwroot/scripts'))
});

The first line tells Visual Studio to run the task ‘default’ after the build finishes. It will also run the ‘clean’ task when you ask Visual Studio to clean the build.
Now right-click on gulpfile.js and click Task Runner Explorer.

If ‘default’ and ‘clean’ tasks don’t show up, refresh the explorer:

Write a HTML page
Right click on the wwwroot folder (if you don't see the folder try building the project) and add a New Item named index.html inside. Use the following code for index.html










        Compiler: 
        Framework: 




Test

Run the project
As you type on the boxes you should see the message appear/change!


Debug

In Edge, press F12 and click the Debugger tab.
Look in the first localhost folder, then scripts/app.ts
Put a breakpoint on the line with return.
Type in the boxes and confirm that the breakpoint hits in TypeScript code and that inspection works correctly.


Congrats you've built your own .NET Core project with a TypeScript frontend.

pages/tutorials/gulp.html.body:
This quick start guide will teach you how to build TypeScript with gulp and then add Browserify, uglify, or Watchify to the gulp pipeline.
This guide also shows how to add Babel functionality using Babelify.
We assume that you're already using Node.js with npm.
Minimal project
Let's start out with a new directory.
We'll name it proj for now, but you can change it to whatever you want.
mkdir proj
cd proj

To start, we're going to structure our project in the following way:
proj/
   ├─ src/
   └─ dist/

TypeScript files will start out in your src folder, run through the TypeScript compiler and end up in dist.
Let's scaffold this out:
mkdir src
mkdir dist

Initialize the project
Now we'll turn this folder into an npm package.
npm init

You'll be given a series of prompts.
You can use the defaults except for your entry point.
For your entry point, use ./dist/main.js.
You can always go back and change these in the package.json file that's been generated for you.
Install our dependencies
Now we can use npm install to install packages.
First install gulp-cli globally (if you use a Unix system, you may need to prefix the npm install commands in this guide with sudo).
npm install -g gulp-cli

Then install typescript, gulp and gulp-typescript in your project's dev dependencies.
Gulp-typescript is a gulp plugin for Typescript.
npm install --save-dev typescript gulp@4.0.0 gulp-typescript

Write a simple example
Let's write a Hello World program.
In src, create the file main.ts:
function hello(compiler: string) {
    console.log(`Hello from ${compiler}`);
}
hello('TypeScript');

In the project root, proj, create the file tsconfig.json:
{
    "files": [
        "src/main.ts"
    ],
    "compilerOptions": {
        "noImplicitAny": true,
        "target": "es5"
    }
}

Create a gulpfile.js
In the project root, create the file gulpfile.js:
var gulp = require('gulp');
var ts = require('gulp-typescript');
var tsProject = ts.createProject('tsconfig.json');

gulp.task('default', function () {
    return tsProject.src()
        .pipe(tsProject())
        .js.pipe(gulp.dest('dist'));
});

Test the resulting app
gulp
node dist/main.js

The program should print "Hello from TypeScript!".
Add modules to the code
Before we get to Browserify, let's build our code out and add modules to the mix.
This is the structure you're more likely to use for a real app.
Create a file called src/greet.ts:
export function sayHello(name: string) {
    return `Hello from ${name}`;
}

Now change the code in src/main.ts to import sayHello from greet.ts:
import { sayHello } from './greet';

console.log(sayHello('TypeScript'));

Finally, add src/greet.ts to tsconfig.json:
{
    "files": [
        "src/main.ts",
        "src/greet.ts"
    ],
    "compilerOptions": {
        "noImplicitAny": true,
        "target": "es5"
    }
}

Make sure that the modules work by running gulp and then testing in Node:
gulp
node dist/main.js

Notice that even though we used ES2015 module syntax, TypeScript emitted CommonJS modules that Node uses.
We'll stick with CommonJS for this tutorial, but you could set module in the options object to change this.
Browserify
Now let's move this project from Node to the browser.
To do this, we'd  like to bundle all our modules into one JavaScript file.
Fortunately, that's exactly what Browserify does.
Even better, it lets us use the CommonJS module system used by Node, which is the default TypeScript emit.
That means our TypeScript and Node setup will transfer to the browser basically unchanged.
First, install browserify, tsify, and vinyl-source-stream.
tsify is a Browserify plugin that, like gulp-typescript, gives access to the TypeScript compiler.
vinyl-source-stream lets us adapt the file output of Browserify back into a format that gulp understands called vinyl.
npm install --save-dev browserify tsify vinyl-source-stream

Create a page
Create a file in src named index.html:




        Hello World!


        Loading ...




Now change main.ts to update the page:
import { sayHello } from './greet';

function showHello(divName: string, name: string) {
    const elt = document.getElementById(divName);
    elt.innerText = sayHello(name);
}

showHello('greeting', 'TypeScript');

Calling showHello calls sayHello to change the paragraph's text.
Now change your gulpfile to the following:
var gulp = require('gulp');
var browserify = require('browserify');
var source = require('vinyl-source-stream');
var tsify = require('tsify');
var paths = {
    pages: ['src/*.html']
};

gulp.task('copy-html', function () {
    return gulp.src(paths.pages)
        .pipe(gulp.dest('dist'));
});

gulp.task('default', gulp.series(gulp.parallel('copy-html'), function () {
    return browserify({
        basedir: '.',
        debug: true,
        entries: ['src/main.ts'],
        cache: {},
        packageCache: {}
    })
    .plugin(tsify)
    .bundle()
    .pipe(source('bundle.js'))
    .pipe(gulp.dest('dist'));
}));

This adds the copy-html task and adds it as a dependency of default.
That means any time default is run, copy-html has to run first.
We've also changed default to call Browserify with the tsify plugin instead of gulp-typescript.
Conveniently, they both allow us to pass the same options object to the TypeScript compiler.
After calling bundle we use source (our alias for vinyl-source-stream) to name our output bundle bundle.js.
Test the page by running gulp and then opening dist/index.html in a browser.
You should see "Hello from TypeScript" on the page.
Notice that we specified debug: true to Browserify.
This causes tsify to emit source maps inside the bundled JavaScript file.
Source maps let you debug your original TypeScript code in the browser instead of the bundled JavaScript.
You can test that source maps are working by opening the debugger for your browser and putting a breakpoint inside main.ts.
When you refresh the page the breakpoint should pause the page and let you debug greet.ts.
Watchify, Babel, and Uglify
Now that we are bundling our code with Browserify and tsify, we can add various features to our build with browserify plugins.

Watchify starts gulp and keeps it running, incrementally compiling whenever you save a file.
This lets you keep an edit-save-refresh cycle going in the browser.

Babel is a hugely flexible compiler that converts ES2015 and beyond into ES5 and ES3.
This lets you add extensive and customized transformations that TypeScript doesn't support.

Uglify compacts your code so that it takes less time to download.


Watchify
We'll start with Watchify to provide background compilation:
npm install --save-dev watchify fancy-log

Now change your gulpfile to the following:
var gulp = require('gulp');
var browserify = require('browserify');
var source = require('vinyl-source-stream');
var watchify = require('watchify');
var tsify = require('tsify');
var fancy_log = require('fancy-log');
var paths = {
    pages: ['src/*.html']
};

var watchedBrowserify = watchify(browserify({
    basedir: '.',
    debug: true,
    entries: ['src/main.ts'],
    cache: {},
    packageCache: {}
}).plugin(tsify));

gulp.task('copy-html', function () {
    return gulp.src(paths.pages)
        .pipe(gulp.dest('dist'));
});

function bundle() {
    return watchedBrowserify
        .bundle()
        .on('error', fancy_log)
        .pipe(source('bundle.js'))
        .pipe(gulp.dest('dist'));
}

gulp.task('default', gulp.series(gulp.parallel('copy-html'), bundle));
watchedBrowserify.on('update', bundle);
watchedBrowserify.on('log', fancy_log);

There are basically three changes here, but they require you to refactor your code a bit.

We wrapped our browserify instance in a call to watchify, and then held on to the result.
We called watchedBrowserify.on('update', bundle); so that Browserify will run the bundle function every time one of your TypeScript files changes.
We called watchedBrowserify.on('log', fancy_log); to log to the console.

Together (1) and (2) mean that we have to move our call to browserify out of the default task.
And we have to give the function for default a name since both Watchify and Gulp need to call it.
Adding logging with (3) is optional but very useful for debugging your setup.
Now when you run Gulp, it should start and stay running.
Try changing the code for showHello in main.ts and saving it.
You should see output that looks like this:
proj$ gulp
[10:34:20] Using gulpfile ~/src/proj/gulpfile.js
[10:34:20] Starting 'copy-html'...
[10:34:20] Finished 'copy-html' after 26 ms
[10:34:20] Starting 'default'...
[10:34:21] 2824 bytes written (0.13 seconds)
[10:34:21] Finished 'default' after 1.36 s
[10:35:22] 2261 bytes written (0.02 seconds)
[10:35:24] 2808 bytes written (0.05 seconds)

Uglify
First install Uglify.
Since the point of Uglify is to mangle your code, we also need to install vinyl-buffer and gulp-sourcemaps to keep sourcemaps working.
npm install --save-dev gulp-uglify vinyl-buffer gulp-sourcemaps

Now change your gulpfile to the following:
var gulp = require('gulp');
var browserify = require('browserify');
var source = require('vinyl-source-stream');
var tsify = require('tsify');
var uglify = require('gulp-uglify');
var sourcemaps = require('gulp-sourcemaps');
var buffer = require('vinyl-buffer');
var paths = {
    pages: ['src/*.html']
};

gulp.task('copy-html', function () {
    return gulp.src(paths.pages)
        .pipe(gulp.dest('dist'));
});

gulp.task('default', gulp.series(gulp.parallel('copy-html'), function () {
    return browserify({
        basedir: '.',
        debug: true,
        entries: ['src/main.ts'],
        cache: {},
        packageCache: {}
    })
    .plugin(tsify)
    .bundle()
    .pipe(source('bundle.js'))
    .pipe(buffer())
    .pipe(sourcemaps.init({loadMaps: true}))
    .pipe(uglify())
    .pipe(sourcemaps.write('./'))
    .pipe(gulp.dest('dist'));
}));

Notice that uglify itself has just one call — the calls to buffer and sourcemaps exist to make sure sourcemaps keep working.
These calls give us a separate sourcemap file instead of using inline sourcemaps like before.
Now you can run Gulp and check that bundle.js does get minified into an unreadable mess:
gulp
cat dist/bundle.js

Babel
First install Babelify and the Babel preset for ES2015.
Like Uglify, Babelify mangles code, so we'll need vinyl-buffer and gulp-sourcemaps.
By default Babelify will only process files with extensions of .js, .es, .es6 and .jsx so we need to add the .ts extension as an option to Babelify.
npm install --save-dev babelify@8 babel-core babel-preset-es2015 vinyl-buffer gulp-sourcemaps

Now change your gulpfile to the following:
var gulp = require('gulp');
var browserify = require('browserify');
var source = require('vinyl-source-stream');
var tsify = require('tsify');
var sourcemaps = require('gulp-sourcemaps');
var buffer = require('vinyl-buffer');
var paths = {
    pages: ['src/*.html']
};

gulp.task('copy-html', function () {
    return gulp.src(paths.pages)
        .pipe(gulp.dest('dist'));
});

gulp.task('default', gulp.series(gulp.parallel('copy-html'), function () {
    return browserify({
        basedir: '.',
        debug: true,
        entries: ['src/main.ts'],
        cache: {},
        packageCache: {}
    })
    .plugin(tsify)
    .transform('babelify', {
        presets: ['es2015'],
        extensions: ['.ts']
    })
    .bundle()
    .pipe(source('bundle.js'))
    .pipe(buffer())
    .pipe(sourcemaps.init({loadMaps: true}))
    .pipe(sourcemaps.write('./'))
    .pipe(gulp.dest('dist'));
}));

We also need to have TypeScript target ES2015.
Babel will then produce ES5 from the ES2015 code that TypeScript emits.
Let's modify tsconfig.json:
{
    "files": [
        "src/main.ts"
    ],
    "compilerOptions": {
        "noImplicitAny": true,
        "target": "es2015"
    }
}

Babel's ES5 output should be very similar to TypeScript's output for such a simple script.

pages/tutorials/migrating-from-javascrip.body:
TypeScript doesn't exist in a vacuum.
It was built with the JavaScript ecosystem in mind, and a lot of JavaScript exists today.
Converting a JavaScript codebase over to TypeScript is, while somewhat tedious, usually not challenging.
In this tutorial, we're going to look at how you might start out.
We assume you've read enough of the handbook to write new TypeScript code.
If you're looking to convert a React project, we recommend looking at the React Conversion Guide first.
Setting up your Directories
If you're writing in plain JavaScript, it's likely that you're running your JavaScript directly,
  where your .js files are in a src, lib, or dist directory, and then ran as desired.
If that's the case, the files that you've written are going to be used as inputs to TypeScript, and you'll run the outputs it produces.
During our JS to TS migration, we'll need to separate our input files to prevent TypeScript from overwriting them.
If your output files need to reside in a specific directory, then that will be your output directory.
You might also be running some intermediate steps on your JavaScript, such as bundling or using another transpiler like Babel.
In this case, you might already have a folder structure like this set up.
From this point on, we're going to assume that your directory is set up something like this:
projectRoot
├── src
│   ├── file1.js
│   └── file2.js
├── built
└── tsconfig.json

If you have a tests folder outside of your src directory, you might have one tsconfig.json in src, and one in tests as well.
Writing a Configuration File
TypeScript uses a file called tsconfig.json for managing your project's options, such as which files you want to include, and what sorts of checking you want to perform.
Let's create a bare-bones one for our project:
{
    "compilerOptions": {
        "outDir": "./built",
        "allowJs": true,
        "target": "es5"
    },
    "include": [
        "./src/**/*"
    ]
}

Here we're specifying a few things to TypeScript:

Read in any files it understands in the src directory (with include).
Accept JavaScript files as inputs (with allowJs).
Emit all of the output files in built (with outDir).
Translate newer JavaScript constructs down to an older version like ECMAScript 5 (using target).

At this point, if you try running tsc at the root of your project, you should see output files in the built directory.
The layout of files in built should look identical to the layout of src.
You should now have TypeScript working with your project.
Early Benefits
Even at this point you can get some great benefits from TypeScript understanding your project.
If you open up an editor like VS Code or Visual Studio, you'll see that you can often get some tooling support like completion.
You can also catch certain bugs with options like:

noImplicitReturns which prevents you from forgetting to return at the end of a function.
noFallthroughCasesInSwitch which is helpful if you never want to forget a break statement between cases in a switch block.

TypeScript will also warn about unreachable code and labels, which you can disable with allowUnreachableCode and allowUnusedLabels respectively.
Integrating with Build Tools
You might have some more build steps in your pipeline.
Perhaps you concatenate something to each of your files.
Each build tool is different, but we'll do our best to cover the gist of things.
Gulp
If you're using Gulp in some fashion, we have a tutorial on using Gulp with TypeScript, and integrating with common build tools like Browserify, Babelify, and Uglify.
You can read more there.
Webpack
Webpack integration is pretty simple.
You can use awesome-typescript-loader, a TypeScript loader, combined with source-map-loader for easier debugging.
Simply run
npm install awesome-typescript-loader source-map-loader

and merge in options from the following into your webpack.config.js file:
module.exports = {
    entry: "./src/index.ts",
    output: {
        filename: "./dist/bundle.js",
    },

    // Enable sourcemaps for debugging webpack's output.
    devtool: "source-map",

    resolve: {
        // Add '.ts' and '.tsx' as resolvable extensions.
        extensions: ["", ".webpack.js", ".web.js", ".ts", ".tsx", ".js"]
    },

    module: {
        loaders: [
            // All files with a '.ts' or '.tsx' extension will be handled by 'awesome-typescript-loader'.
            { test: /\.tsx?$/, loader: "awesome-typescript-loader" }
        ],

        preLoaders: [
            // All output '.js' files will have any sourcemaps re-processed by 'source-map-loader'.
            { test: /\.js$/, loader: "source-map-loader" }
        ]
    },

    // Other options...
};

It's important to note that awesome-typescript-loader will need to run before any other loader that deals with .js files.
The same goes for ts-loader, another TypeScript loader for Webpack.
You can read more about the differences between the two here.
You can see an example of using Webpack in our tutorial on React and Webpack.
Moving to TypeScript Files
At this point, you're probably ready to start using TypeScript files.
The first step is to rename one of your .js files to .ts.
If your file uses JSX, you'll need to rename it to .tsx.
Finished with that step?
Great!
You've successfully migrated a file from JavaScript to TypeScript!
Of course, that might not feel right.
If you open that file in an editor with TypeScript support (or if you run tsc --pretty), you might see red squiggles on certain lines.
You should think of these the same way you'd think of red squiggles in an editor like Microsoft Word.
TypeScript will still translate your code, just like Word will still let you print your documents.
If that sounds too lax for you, you can tighten that behavior up.
If, for instance, you don't want TypeScript to compile to JavaScript in the face of errors, you can use the noEmitOnError option.
In that sense, TypeScript has a dial on its strictness, and you can turn that knob up as high as you want.
If you plan on using the stricter settings that are available, it's best to turn them on now (see Getting Stricter Checks below).
For instance, if you never want TypeScript to silently infer any for a type without you explicitly saying so, you can use noImplicitAny before you start modifying your files.
While it might feel somewhat overwhelming, the long-term gains become apparent much more quickly.
Weeding out Errors
Like we mentioned, it's not unexpected to get error messages after conversion.
The important thing is to actually go one by one through these and decide how to deal with the errors.
Often these will be legitimate bugs, but sometimes you'll have to explain what you're trying to do a little better to TypeScript.
Importing from Modules
You might start out getting a bunch of errors like Cannot find name 'require'., and Cannot find name 'define'..
In these cases, it's likely that you're using modules.
While you can just convince TypeScript that these exist by writing out
// For Node/CommonJS
declare function require(path: string): any;

or
// For RequireJS/AMD
declare function define(...args: any[]): any;

it's better to get rid of those calls and use TypeScript syntax for imports.
First, you'll need to enable some module system by setting TypeScript's module flag.
Valid options are commonjs, amd, system, and umd.
If you had the following Node/CommonJS code:
var foo = require("foo");

foo.doStuff();

or the following RequireJS/AMD code:
define(["foo"], function(foo) {
    foo.doStuff();
})

then you would write the following TypeScript code:
import foo = require("foo");

foo.doStuff();

Getting Declaration Files
If you started converting over to TypeScript imports, you'll probably run into errors like Cannot find module 'foo'..
The issue here is that you likely don't have declaration files to describe your library.
Luckily this is pretty easy.
If TypeScript complains about a package like lodash, you can just write
npm install -S @types/lodash

If you're using a module option other than commonjs, you'll need to set your moduleResolution option to node.
After that, you'll be able to import lodash with no issues, and get accurate completions.
Exporting from Modules
Typically, exporting from a module involves adding properties to a value like exports or module.exports.
TypeScript allows you to use top-level export statements.
For instance, if you exported a function like so:
module.exports.feedPets = function(pets) {
    // ...
}

you could write that out as the following:
export function feedPets(pets) {
    // ...
}

Sometimes you'll entirely overwrite the exports object.
This is a common pattern people use to make their modules immediately callable like in this snippet:
var express = require("express");
var app = express();

You might have previously written that like so:
function foo() {
    // ...
}
module.exports = foo;

In TypeScript, you can model this with the export = construct.
function foo() {
    // ...
}
export = foo;

Too many/too few arguments
You'll sometimes find yourself calling a function with too many/few arguments.
Typically, this is a bug, but in some cases, you might have declared a function that uses the arguments object instead of writing out any parameters:
function myCoolFunction() {
    if (arguments.length == 2 && !Array.isArray(arguments[1])) {
        var f = arguments[0];
        var arr = arguments[1];
        // ...
    }
    // ...
}

myCoolFunction(function(x) { console.log(x) }, [1, 2, 3, 4]);
myCoolFunction(function(x) { console.log(x) }, 1, 2, 3, 4);

In this case, we need to use TypeScript to tell any of our callers about the ways myCoolFunction can be called using function overloads.
function myCoolFunction(f: (x: number) => void, nums: number[]): void;
function myCoolFunction(f: (x: number) => void, ...nums: number[]): void;
function myCoolFunction() {
    if (arguments.length == 2 && !Array.isArray(arguments[1])) {
        var f = arguments[0];
        var arr = arguments[1];
        // ...
    }
    // ...
}

We added two overload signatures to myCoolFunction.
The first checks states that myCoolFunction takes a function (which takes a number), and then a list of numbers.
The second one says that it will take a function as well, and then uses a rest parameter (...nums) to state that any number of arguments after that need to be numbers.
Sequentially Added Properties
Some people find it more aesthetically pleasing to create an object and add properties immediately after like so:
var options = {};
options.color = "red";
options.volume = 11;

TypeScript will say that you can't assign to color and volume because it first figured out the type of options as {} which doesn't have any properties.
If you instead moved the declarations into the object literal themselves, you'd get no errors:
let options = {
    color: "red",
    volume: 11
};

You could also define the type of options and add a type assertion on the object literal.
interface Options { color: string; volume: number }

let options = {} as Options;
options.color = "red";
options.volume = 11;

Alternatively, you can just say options has the type any which is the easiest thing to do, but which will benefit you the least.
any, Object, and {}
You might be tempted to use Object or {} to say that a value can have any property on it because Object is, for most purposes, the most general type.
However any is actually the type you want to use in those situations, since it's the most flexible type.
For instance, if you have something that's typed as Object you won't be able to call methods like toLowerCase() on it.
Being more general usually means you can do less with a type, but any is special in that it is the most general type while still allowing you to do anything with it.
That means you can call it, construct it, access properties on it, etc.
Keep in mind though, whenever you use any, you lose out on most of the error checking and editor support that TypeScript gives you.
If a decision ever comes down to Object and {}, you should prefer {}.
While they are mostly the same, technically {} is a more general type than Object in certain esoteric cases.
Getting Stricter Checks
TypeScript comes with certain checks to give you more safety and analysis of your program.
Once you've converted your codebase to TypeScript, you can start enabling these checks for greater safety.
No Implicit any
There are certain cases where TypeScript can't figure out what certain types should be.
To be as lenient as possible, it will decide to use the type any in its place.
While this is great for migration, using any means that you're not getting any type safety, and you won't get the same tooling support you'd get elsewhere.
You can tell TypeScript to flag these locations down and give an error with the noImplicitAny option.
Strict null & undefined Checks
By default, TypeScript assumes that null and undefined are in the domain of every type.
That means anything declared with the type number could be null or undefined.
Since null and undefined are such a frequent source of bugs in JavaScript and TypeScript, TypeScript has the strictNullChecks option to spare you the stress of worrying about these issues.
When strictNullChecks is enabled, null and undefined get their own types called null and undefined respectively.
Whenever anything is possibly null, you can use a union type with the original type.
So for instance, if something could be a number or null, you'd write the type out as number | null.
If you ever have a value that TypeScript thinks is possibly null/undefined, but you know better, you can use the postfix ! operator to tell it otherwise.
declare var foo: string[] | null;

foo.length;  // error - 'foo' is possibly 'null'

foo!.length; // okay - 'foo!' just has type 'string[]'

As a heads up, when using strictNullChecks, your dependencies may need to be updated to use strictNullChecks as well.
No Implicit any for this
When you use the this keyword outside of classes, it has the type any by default.
For instance, imagine a Point class, and imagine a function that we wish to add as a method:
class Point {
    constructor(public x, public y) {}
    getDistance(p: Point) {
        let dx = p.x - this.x;
        let dy = p.y - this.y;
        return Math.sqrt(dx ** 2 + dy ** 2);
    }
}
// ...

// Reopen the interface.
interface Point {
    distanceFromOrigin(point: Point): number;
}
Point.prototype.distanceFromOrigin = function(point: Point) {
    return this.getDistance({ x: 0, y: 0});
}

This has the same problems we mentioned above - we could easily have misspelled getDistance and not gotten an error.
For this reason, TypeScript has the noImplicitThis option.
When that option is set, TypeScript will issue an error when this is used without an explicit (or inferred) type.
The fix is to use a this-parameter to give an explicit type in the interface or in the function itself:
Point.prototype.distanceFromOrigin = function(this: Point, point: Point) {
    return this.getDistance({ x: 0, y: 0});
}

pages/tutorials/react-&-webpack.html.body:
이 가이드는 TypeScript를 React 및 webpack에 연결하는 방법을 알려줍니다.
새로운 프로젝트를 시작하는 경우, 먼저 React Quick Start guide를 살펴보세요.
그렇지 않으면 이미 npm과 함께 Node.js를 사용하고 있다고 가정합니다.
프로젝트 배치 (Lay out the project)
새 디렉토리부터 시작하겠습니다.
지금은 이름을 proj라고 지정하지만, 원하는대로 변경할 수 있습니다.
mkdir proj
cd proj

시작하기 위해, 다음과 같은 방식으로 프로젝트를 구성하겠습니다:
proj/
├─ dist/
└─ src/
   └─ components/

TypeScript 파일은 src 폴더에서 시작하여, TypeScript 컴파일러를 통해 실행한 다음, webpack을 거쳐 dist의 main.js 파일로 끝납니다.
우리가 작성하는 모든 컴포넌트는 src/components 폴더 안에 있습니다.
이것을 기본 뼈대로 구성합니다:
mkdir src
cd src
mkdir components
cd ..

Webpack으로 마지막엔 dist폴더를 생성할 것입니다.
프로젝트 초기화 (Initialize the project)
이제 이 폴더를 npm 패키지로 바꿀 것 입니다.
npm init -y

기본값으로 package.json 파일이 생성됩니다.
의존성 설치 (Install our dependencies)
먼저 Webpack이 설치되어 있는지 확인합니다.
npm install --save-dev webpack webpack-cli

Webpack은 코드와 선택적으로 모든 의존성을 하나의 .js파일로 묶는 도구입니다.
이제 선언 파일과 함께 React 및 React-DOM을 package.json 파일에 의존성으로 추가하겠습니다:
npm install --save react react-dom
npm install --save-dev @types/react @types/react-dom

@types/ 접두사는 React와 React-DOM의 선언 파일을 가져오고 싶다는 것을 의미합니다.
일반적으로 "react"와 같은 경로를 가져오면, react 패키지 자체를 살펴볼 것입니다;
그러나 모든 패키지에 선언 파일이 포함되어 있지 않기 때문에, TypeScript는 @types/react 패키지도 찾습니다.
나중에는 이것에 대해 생각할 필요가 없다는 것을 알 수 있습니다.
다음으로, 개발 시 필요한 의존성에 ts-loader와source-map-loader를 추가합니다.
npm install --save-dev typescript ts-loader source-map-loader

이 의존성들은  TypeScript와 Webpack을 같이 쓸 수 있게 해줍니다.
ts-loader는 Webpack이 tsconfig.json이라는 TypeScript 표준 구성 파일을 사용하여 TypeScript 코드를 컴파일하도록 도와줍니다.
source-map-loader는 TypeScript의 소스 맵 출력을 사용하여 고유한 소스 맵을 생성할 때 Webpack에 알립니다.
이렇게 하면 기존의 TypeScript 소스 코드를 디버깅하는 것 처럼 최종 출력 파일을 디버깅 할 수 있습니다.
ts-loader가 TypeScript의 유일한 로더는 아님을 유의해주세요
TypeScript를 개발 의존성으로  설치했다는 것에 유의하세요.
npm link typescript를 사용하여 TypeScript를 전역 복사본에 연결할 수도 있지만, 덜 일반적인 시나리오입니다.
TypeScript 구성 파일 추가 (Add a TypeScript configuration file)
작성하려는 코드와 필요한 선언 파일 모두 TypeScript 파일로 가져오기를 원할 것입니다.
이렇게 하려면, 입력 파일 목록과 모든 컴파일 설정을 포함하는 tsconfig.json 파일을 만들어야 합니다.
프로젝트 루트에 tsconfig.json이라는 새 파일을 생성하고, 다음 내용을 채우세요:
{
    "compilerOptions": {
        "outDir": "./dist/",
        "sourceMap": true,
        "noImplicitAny": true,
        "module": "commonjs",
        "target": "es6",
        "jsx": "react"
    }
}

tsconfig.json 파일에 대한 자세한 내용은 여기를 참조하세요.
코드 작성하기 (Write some code)
React를 사용하여 첫 번째 TypeScript 파일을 작성해 봅시다.
먼저, src/components에 Hello.tsx 파일을 만들고 다음과 같이 작성하세요:
import * as React from "react";

export interface HelloProps { compiler: string; framework: string; }

export const Hello = (props: HelloProps) => Hello from {props.compiler} and {props.framework}!;

이 예제는 함수 컴포넌트를 사용하지만, 예제를 조금 더 고급스럽게 만들 수 있습니다.
import * as React from "react";

export interface HelloProps { compiler: string; framework: string; }

// 'HelloProps'는 props의 형태를 나타냅니다.
// state는 설정되지 않으므로, `{}` 타입을 사용합니다.
export class Hello extends React.Component {
    render() {
        return Hello from {this.props.compiler} and {this.props.framework}!;
    }
}

다음 소스를 이용하여 src에 index.tsx를 생성합니다.
import * as React from "react";
import * as ReactDOM from "react-dom";

import { Hello } from "./components/Hello";

ReactDOM.render(
    ,
    document.getElementById("example")
);

방금 Hello 컴포넌트를 index.tsx로 가져왔습니다.
"react"나 "react-dom"과는 달리, Hello.tsx에 대한 상대 경로를 사용했다는 것에 유의하세요. - 이것은 중요합니다.
그렇지 않은 경우, TypeScript는 대신 node_modules 폴더를 찾았습니다.
Hello 컴포넌트를 표시할 페이지도 필요합니다.
proj의 루트에 index.html 파일을 생성하고 다음과 같이 작성하세요:




        Hello React!













우리는 node_modules 안에 들어있는 파일을 포함시킵니다.
React와 React-DOM의 npm 패키지에는 웹 페이지에 포함 할 수 있는 독립형 .js 파일이 있으며, 보다 빠르게 이동하기 위해 직접 찹조합니다.
이런 파일을 다른 디렉토리에 복사하거나, CDN(Content Delivery Network)에서 호스팅합니다.
Facebook은 CDN-호스트 버전의 React를 제공하며, 여기에서 자세한 내용을 읽을 수 있습니다.
Webpack 구성 파일 생성하기 (Create a webpack configuration file)
프로젝트 디렉토리의 루트에 webpack.config.js 파일을 생성합니다.
module.exports = {
    mode: "production",

    // Webpack의 출력물에서 디버깅을 하기위해 소스 맵을 허용합니다.
    devtool: "source-map",

    resolve: {
        // 확인 가능한 확장자로 '.ts' 와 '.tsx' 를 추가합니다.
        extensions: [".ts", ".tsx"]
    },

    module: {
        rules: [
            {
                test: /\.ts(x?)$/,
                exclude: /node_modules/,
                use: [
                    {
                        loader: "ts-loader"
                    }
                ]
            },
            // 모든 '.js' 출력 파일은 'source-map-loader'에서 다시 처리한 소스 맵이 있습니다.
            {
                enforce: "pre",
                test: /\.js$/,
                loader: "source-map-loader"
            }
        ]
    },

    // 경로가 다음 중 하나와 일치하는 모듈을 가져올 때,
    // 해당 전역 변수가 있다고 가정하고 사용합니다.
    // 브라우저가 빌드간에 라이브러리를 캐시 할 수 있도록
    // 모든 의존성을 묶지 않아도 되기 때문에 중요합니다.
    externals: {
        "react": "React",
        "react-dom": "ReactDOM"
    }
};

externals 필드에 대해 궁금할 것 입니다.
컴파일 시간이 증가하고 브라우저가 라이브러리를 변경하지 않으면, 일반적으로 라이브러리를 캐시 할 수 있기 때문에 모든 React를 동일한 파일에 묶지 않는 것이 좋습니다.
이상적으로 브라우저 내에서 React 모듈을 가져오지만, 대부분의 브라우저는 아직 모듈을 지원하지 않습니다.
대신 라이브러리는 전통적으로 jQuery 나 _ 와 같은 단일 전역 변수를 사용하여 사용할 수 있습니다.
이런 방식을 "namespace pattern"이라고 하며, Webpack을 사용하면 이 방식으로 작성된 라이브러리를 계속 활용할 수 있습니다.
"react": "React"를 입력하면 Webpack은 React 변수에서 "react"를 불러오기 위해 마법을 사용할 것 입니다.
여기에서 Webpack 구성에 대해 자세히 알아볼 수 있습니다.
모든 것을 함께 모아서 (Putting it all together)
그냥 실행합니다:
npx webpack

이제 즐겨 찾는 브라우저에서 index.html을 열고 모든 것을 사용할 준비가 되었습니다!
"Hello from TypeScript and React!" 라는 페이지가 나타납니다.

pages/release-notes/typescript-3.8.html.body:
타입-전용 Imports 와 Exports
ECMAScript 비공개 필드
export * as ns 구문
최상위-레벨 await
JSDoc 프로퍼티 지정자
리눅스에서 더 나은 디렉터리 감시와 watchOptions
"빠르고 느슨한" 증분 검사

 타입-전용 Imports 와 Exports (Type-Only Imports and Exports)
이 기능은 대부분의 사용자에겐 생각할 필요가 없을 수도 있지만; --isolatedModules, TypeScript의 transpileModule API, 또는 Babel에서 문제가 발생하면 이 기능과 관련이 있을 수 있습니다.
TypeScript 3.8은 타입-전용 imports, exports를 위한 새로운 구문이 추가되었습니다.
import type { SomeThing } from "./some-module.js";

export type { SomeThing };

import type은 타입 표기와 선언에 사용될 선언만 import 합니다.
이는 항상 완전히 제거되므로, 런타임에 남아있는 것은 없습니다.
마찬가지로, export type은 타입 문맥에 사용할 export만 제공하며, 이 또한 TypeScript의 출력물에서 제거됩니다.
클래스는 런타임에 값을 가지고 있고 디자인-타임에 타입이 있으며 사용은 상황에-따라 다르다는 것을 유의해야 합니다.
클래스를 import 하기 위해 import type을 사용하면, 확장 같은 것은 할 수 없습니다.
import type { Component } from "react";

interface ButtonProps {
    // ...
}

class Button extends Component {
    //               ~~~~~~~~~
    // error! 'Component' only refers to a type, but is being used as a value here.

    // ...
}

이전에 Flow를 사용해본 적이 있다면, 이 구문은 상당히 유사합니다.
한 가지 차이점은 코드가 모호해 보이지 않도록 몇 가지 제한을 두었다는 것입니다.
// 'Foo'만 타입인가? 혹은 모든 import 선언이 타입인가?
// 이는 명확하지 않기 때문에 오류로 처리합니다.

import type Foo, { Bar, Baz } from "some-module";
//     ~~~~~~~~~~~~~~~~~~~~~~
// error! A type-only import can specify a default import or named bindings, but not both.

import type과 함께, TypeScript 3.8은 런타임 시 사용되지 않는 import에서 발생하는 작업을 제어하기 위해 새로운 컴파일러 플래그를 추가합니다: importsNotUsedAsValues.
이 플래그는 3 가지 다른 값을 가집니다:

remove: 이는 imports를 제거하는 현재 동작이며, 계속 기본값으로 작동할 것이며, 기존 동작을 바꾸는 변화가 아닙니다.
preserve: 이는 사용되지 않는 값들을 모두 보존합니다. 이로 인해 imports/side-effects가 보존될 수 있습니다.
error: 이는 모든 (preserve option 처럼) 모든 imports를 보존하지만, import 값이 타입으로만 사용될 경우 오류를 발생시킵니다. 이는 실수로 값을 import하지 않지만 사이드 이팩트 import를 명시적으로 만들고 싶을 때 유용합니다.

이 기능에 대한 더 자세한 정보는, import type선언이 사용될수 있는 범위를 확대하는 pull request, 와 관련된 변경 사항에서 찾을 수 있습니다.
 ECMAScript 비공개 필드 (ECMAScript Private Fields)
TypeScript 3.8 은 ECMAScript의 stage-3 클래스 필드 제안의 비공개 필드를 지원합니다.
class Person {
    #name: string

    constructor(name: string) {
        this.#name = name;
    }

    greet() {
        console.log(`Hello, my name is ${this.#name}!`);
    }
}

let jeremy = new Person("Jeremy Bearimy");

jeremy.#name
//     ~~~~~
// 프로퍼티 '#name'은 'Person' 클래스 외부에서 접근할 수 없습니다.
// 이는 비공개 식별자를 가지기 때문입니다.

일반적인 프로퍼티들(private 지정자로 선언한 것도)과 달리, 비공개 필드는 몇 가지 명심해야 할 규칙이 있습니다.
그중 몇몇은:

비공개 필드는 # 문자로 시작합니다. 때때로 이를 비공개 이름(private names) 이라고 부릅니다.
모든 비공개 필드 이름은 이를 포함한 클래스 범위에서 유일합니다.
public 또는 private 같은 TypeScript 접근 지정자는 비공개 필드로 사용될 수 없습니다.  
JS 사용자로부터도 비공개 필드는 이를 포함한 클래스 밖에서 접근하거나 탐지할 수 없습니다! 때때로 이를 강한 비공개(hard privacy) 라고 부릅니다.

"강한" 비공개와 별도로, 비공개 필드의 또 다른 장점은 유일하다는 것입니다.
예를 들어, 일반적인 프로퍼티 선언은 하위클래스에서 덮어쓰기 쉽습니다.
class C {
    foo = 10;

    cHelper() {
        return this.foo;
    }
}

class D extends C {
    foo = 20;

    dHelper() {
        return this.foo;
    }
}

let instance = new D();
// 'this.foo' 는 각 인스턴스마다 같은 프로퍼티를 참조합니다.
console.log(instance.cHelper()); // '20' 출력
console.log(instance.dHelper()); // '20' 출력

비공개 필드에서는, 포함하고 있는 클래스에서 각각의 필드 이름이 유일하기 때문에 이에 대해 걱정하지 않아도 됩니다.
class C {
    #foo = 10;

    cHelper() {
        return this.#foo;
    }
}

class D extends C {
    #foo = 20;

    dHelper() {
        return this.#foo;
    }
}

let instance = new D();
// 'this.#foo' 는 각 클래스안의 다른 필드를 참조합니다.
console.log(instance.cHelper()); // '10' 출력
console.log(instance.dHelper()); // '20' 출력

알아 두면 좋은 또 다른 점은 다른 타입으로 비공개 필드에 접근하면 TypeError 를 발생한다는 것입니다.
class Square {
    #sideLength: number;

    constructor(sideLength: number) {
        this.#sideLength = sideLength;
    }

    equals(other: any) {
        return this.#sideLength === other.#sideLength;
    }
}

const a = new Square(100);
const b = { sideLength: 100 };

// Boom!
// TypeError: attempted to get private field on non-instance
// 이는 `b` 가 `Square`의 인스턴스가 아니기 때문에 실패 합니다.
console.log(a.equals(b));

마자막으로, 모든 일반 .js 파일 사용자들의 경우, 비공개 필드는 항상 할당되기 전에 선언되어야 합니다.
class C {
    // '#foo' 선언이 없습니다.
    // :(

    constructor(foo: number) {
        // SyntaxError!
        // '#foo'는 쓰여지기 전에 선언되어야 합니다.
        this.#foo = foo;
    }
}

JavaScript는 항상 사용자들에게 선언되지 않은 프로퍼티에 접근을 허용했지만, TypeScript는 항상 클래스 프로퍼티 선언을 요구했습니다.
비공개 필드는, .js 또는 .ts 파일에서 동작하는지 상관없이 항상 선언이 필요합니다.
class C {
    /** @type {number} */
    #foo;

    constructor(foo: number) {
        // 동작합니다.
        this.#foo = foo;
    }
}

구현에 대한 더 많은 정보는, the original pull request를 참고하세요
어떤 것을 사용해야 할까요? (Which should I use?)
이미 TypeScript 유저로서 어떤 종류의 비공개를 사용해야 하는지에 대한 많은 질문을 받았습니다: 주로, "private 키워드를 사용해야 하나요 아니면 ECMAScript의 해시/우물 (#) 비공개 필드를 사용해야 하나요?"
상황마다 다릅니다!
프로퍼티에서, TypeScript의 private 지정자는 완전히 지워집니다 - 이는 런타임에서는 완전히 일반 프로퍼티처럼 동작하며 이것이 private 지정자로 선언되었다고 알릴 방법이 없습니다.
private 키워드를 사용할 때, 비공개는 오직 컴파일-타임/디자인-타임에만 시행되며, JavaScript 사용자에게는 전적으로 의도-기반입니다.
class C {
    private foo = 10;
}

// 이는 컴파일 타임에 오류이지만
// TypeScript 가 .js 파일로 출력했을 때는
// 잘 동작하며 '10'을 출력합니다.
console.log(new C().foo);    // '10' 출력
//                  ~~~
// error! Property 'foo' is private and only accessible within class 'C'.

// TypeScript 오류를 피하기 위한 "해결 방법" 으로
// 캄파일 타임에 이것을 허용합니다.
console.log(new C()["foo"]); // prints '10'

이 같은 종류의 "약한 비공개(soft privacy)"는 사용자가 API에 접근할 수 없는 상태에서 일시적으로 작업을 하는 데 도움이 되며, 어떤 런타임에서도 동작합니다.
반면에, ECMAScript의 # 비공개는 완벽하게 클래스 밖에서 접근 불가능합니다.
class C {
    #foo = 10;
}

console.log(new C().#foo); // SyntaxError
//                  ~~~~
// TypeScript 는 오류를 보고 하며 *또한*
// 런타임에도 동작하지 않습니다.

console.log(new C()["#foo"]); // undefined 출력
//          ~~~~~~~~~~~~~~~
// TypeScript 는 'noImplicitAny' 하에서 오류를 보고하며
// `undefined`를 출력합니다.

이런 강한 비공개(hard privacy)는 아무도 내부를 사용할 수 없도록 엄격하게 보장하는데 유용합니다.
만약 라이브러리 작성자일 경우, 비공개 필드를 제거하거나 이름을 바꾸는 것이 급격한 변화를 초래서는 안됩니다.
언급했듯이, 다른 장점은 ECMAScript의 # 비공개가 진짜 비공개이기 때문에 서브클래싱을 쉽게 할 수 있다는 것입니다.
ECMAScript # 비공개 필드를 사용하면, 어떤 서브 클래스도 필드 네이밍 충돌에 대해 걱정할 필요가 없습니다.
TypeScript의 private프로퍼티 선언에서는, 사용자는 여전히 상위 클래스에 선언된 프로퍼티를 짓밟지  않도록 주의해야 합니다.
한 가지 더 생각해봐야 할 것은 코드가 실행되기를 의도하는 곳입니다.
현재 TypeScript는 이 기능을 ECMAScript 2015 (ES6) 이상 버전을 대상으로 하지 않으면 지원할 수 없습니다.
이는 하위 레벨 구현이 비공개를 강제하기 위해 WeakMap을 사용하는데, WeakMap은 메모리 누수를 잃으키지 않도록 폴리필될 수 없기 때문입니다.
반면, TypeScript의 private-선언 프로퍼티는 모든 대상에서 동작합니다- ECMAScript3에서도!
마지막 고려 사항은 속도 일수 있습니다: private 프로퍼티는 다른 어떤 프로퍼티와 다르지 않기 때문에, 어떤 런타임을 대상으로 하단 다른 프로퍼티와 마찬가지로 접근 속도가 빠를 수 있습니다.
반면에, # 비공개 필드는 WeakMap을 이용해 다운 레벨 되기 때문에 사용 속도가 느려질 수 있습니다.
어떤 런타임은 # 비공개 필드 구현을 최적화 하고, 더 빠른 WeakMap을 구현하고 싶을 수 있지만, 모든 런타임에서 그렇지 않을 수 있습니다.
 export * as ns 구문 (export * as ns Syntax)
다른 모듈의 모든 멤버를 하나의 멤버로 내보내는 단일 진입점을 갖는 것은 종종 일반적입니다.
import * as utilities from "./utilities.js";
export { utilities };

이는 매우 일반적이어서 ECMAScript2020은 최근에 이 패턴을 지원하기 위해서 새로운 구문을 추가했습니다.
export * as utilities from "./utilities.js";

이것은 JavaScript에 대한 훌륭한 삶의 질의 향상이며, TypeScript 3.8은 이 구문을 지원합니다.
모듈 대상이 es2020 이전인 경우, TypeScript는 첫 번째 줄의 코드 스니펫을 따라서 무언가를 출력할 것입니다.
 최상위-레벨 await (Top-Level await)
TypeScript 3.8은 "최상위-레벨 await"이라는 편리한 ECMAScript 기능을 지원합니다.
JavaScript 사용자는 await을 사용하기 위해 async 함수를 도입하는 경우가 많으며, 이를 정의한 후 즉시 함수를 호출합니다.
async function main() {
    const response = await fetch("...");
    const greeting = await response.text();
    console.log(greeting);
}

main()
    .catch(e => console.error(e))

이전의 JavaScript(유사한 기능을 가진 대부분의 다른 언어들과 함께)에서 await은 async 함수 내에서 만 허용되었기 때문입니다.
하지만 최상위-레벨 await로, 우리는 모듈의 최상위 레벨에서 await을 사용할 수 있습니다.
const response = await fetch("...");
const greeting = await response.text();
console.log(greeting);

// 모듈인지 확인
export {};

유의할 점이 있습니다: 최상위-레벨 await은 module의 최상위 레벨에서만 동작하며, 파일은 TypeScript가 import나 export를 찾을 때에만 모듈로 간주됩니다.
일부 기본적인 경우에 export {}와 같은 보일러 플레이트를 작성하여 이를 확인할 필요가 있습니다.
이러한 경우가 예상되는 모든 환경에서 최상위 레벨 await은 동작하지 않을 수 있습니다.
현재, target 컴파일러 옵션이 es2017 이상이고, module이 esnext 또는 system인 경우에만 최상위 레벨 await을 사용할 수 있습니다.
몇몇 환경과 번들러내에서의 지원은 제한적으로 작동하거나 실험적 지원을 활성화해야 할 수도 있습니다.
구현에 관한 더 자세한 정보는 the original pull request을 확인하세요.
 es2020용 target과 module   (es2020 for target and module)
TypeScript 3.8은 es2020을 module과 target 옵션으로 지원합니다.
이를 통해 선택적 체이닝 (optional chaining), nullish 병합 (nullish coalescing), export * as ns 그리고 동적인 import(...) 구문과 같은 ECMAScript 2020 기능이 유지됩니다.
또한 bigint 리터럴이 esnext 아래에 안정적인 target을 갖는 것을 의미합니다.
 JSDoc 프로퍼티 지정자 (JSDoc Property Modifiers)
TypeScript 3.8는 allowJs 플래그를 사용하여 JavaScript 파일을 지원하고 checkJs 옵션이나 // @ts-check 주석을 .js 파일 맨 위에 추가하여 JavaScript 파일의 타입-검사를 지원합니다.
JavaScript 파일에는 타입-검사를 위한 전용 구문이 없기 때문에 TypeScript는 JSDoc을 활용합니다.
TypeScript 3.8은 프로퍼티에 대한 몇 가지 새로운 JSDoc 태그를 인식합니다.
먼저 접근 지정자입니다: @public, @private 그리고 @protected입니다.
이 태그들은 TypeScript 내에서 각각 public, private, protected와 동일하게 동작합니다.
// @ts-check

class Foo {
    constructor() {
        /** @private */
        this.stuff = 100;
    }

    printStuff() {
        console.log(this.stuff);
    }
}

new Foo().stuff;
//        ~~~~~
// 오류! 'stuff' 프로퍼티는 private 이기 때문에 오직 'Foo' 클래스 내에서만 접근이 가능합니다.


@public은 항상 암시적이며 생략될 수 있지만, 어디서든 해당 프로퍼티에 접근 가능을 의미합니다.
@private은 오직 프로퍼티를 포함하는 클래스 내에서 해당 프로퍼티 사용 가능을 의미합니다.
@protected는 프로퍼티를 포함하는 클래스와 파생된 모든 하위 클래스내에서 해당 프로퍼티를 사용할 수 있지만, 포함하는 클래스의 인스턴스는 해당 프로퍼티를 사용할 수 없습니다.

다음으로 @readonly 지정자를 추가하여 프로퍼티가 초기화 과정 내에서만 값이 쓰이는 것을 보장합니다.
// @ts-check

class Foo {
    constructor() {
        /** @readonly */
        this.stuff = 100;
    }

    writeToStuff() {
        this.stuff = 200;
        //   ~~~~~
        // 'stuff'는 읽기-전용(read-only) 프로퍼티이기 때문에 할당할 수 없습니다.
    }
}

new Foo().stuff++;
//        ~~~~~
// 'stuff'는 읽기-전용(read-only) 프로퍼티이기 때문에 할당할 수 없습니다.

 리눅스에서 더 나은 디렉터리 감시와 watchOptions
TypeScript 3.8에서는 node_modules의 변경사항을 효율적으로 수집하는데 중요한 새로운 디렉터리 감시 전략을 제공합니다.
리눅스와 같은 운영체제에서 TypeScript는 node_modules에 디렉터리 왓쳐(파일 왓쳐와는 반대로)를 설치하고, 의존성 변화를 감지하기 위해 많은 하위 디렉터리를 설치합니다.
왜냐하면 사용 가능한 파일 왓쳐의 수는 종종 node_modules의 파일 수에 의해 가려지기 때문이고, 추적할 디렉터리 수가 적기 때문입니다.
TypeScript의 이전 버전은 폴더에 디렉터리 왓쳐를 즉시 설치하며, 초기에는 괜찮을 겁니다; 하지만, npm install 할 때, node_modules안에서 많은 일들이 발생할 것이고, TypeScript를 압도하여, 종종 에디터 세션을 아주 느리게 만듭니다.
이를 방지하기 위해, TypeScript 3.8은 디렉터리 왓쳐를 설치하기 전에 조금 기다려서 변동성이 높은 디렉터리에게 안정될 수 있는 시간을 줍니다.
왜냐하면 모든 프로젝트는 다른 전략에서 더 잘 작동할 수 있고, 이 새로운 방법은 당신의 작업 흐름에서는 잘 맞지 않을 수 있습니다. TypeScript 3.8은 파일과 디렉터리를 감시하는데 어떤 감시 전략을 사용할지 컴파일러/언어 서비스에 알려줄 수 있도록 tsconfig.json과 jsconfig.json에 watchOptions란 새로운 필드를 제공합니다.
{
    // 일반적인 컴파일러 옵션들
    "compilerOptions": {
        "target": "es2020",
        "moduleResolution": "node",
        // ...
    },

    // NEW: 파일/디렉터리 감시를 위한 옵션
    "watchOptions": {
        // 파일과 디렉터리에 네이티브 파일 시스템 이벤트 사용
        "watchFile": "useFsEvents",
        "watchDirectory": "useFsEvents",

        // 업데이트가 빈번할 때
        // 업데이트하기 위해 더 자주 파일을 폴링
        "fallbackPolling": "dynamicPriority"
    }
}

watchOptions는 구성할 수 있는 4가지 새로운 옵션이 포함되어 있습니다.

watchFile: 각 파일의 감시 방법 전략. 다음과 같이 설정할 수 있습니다:
fixedPollingInterval: 고정된 간격으로 모든 파일의 변경을 1초에 여러 번 검사합니다.
priorityPollingInterval: 모든 파일의 변경을 1초에 여러 번 검사합니다, 하지만 휴리스틱을 사용하여 특정 타입의 파일은 다른 타입의 파일보다 덜 자주 검사합니다.
dynamicPriorityPolling: 동적 큐를 사용하여 덜-자주 수정된 파일은 적게 검사합니다.
useFsEvents (디폴트): 파일 변화에 운영체제/파일 시스템의 네이티브 이벤트를 사용합니다.
useFsEventsOnParentDirectory: 파일을 포함하고 있는 디렉터리 변경을 감지할 때, 운영체제/파일 시스템의 네이티브 이벤트를 사용합니다. 파일 왓쳐를 적게 사용할 수 있지만, 덜 정확할 수 있습니다.


watchDirectory: 재귀적인 파일-감시 기능이 없는 시스템 안에서 전체 디렉터리 트리가 감시되는 전략. 다음과 같이 설정할 수 있습니다:
fixedPollingInterval: 고정된 간격으로 모든 디렉터리의 변경을 1초에 여러 번 검사합니다.
dynamicPriorityPolling: 동적 큐를 사용하여 덜-자주 수정된 디렉터리는 적게 검사합니다.
useFsEvents (디폴트): 디렉터리 변경에 운영체제/파일 시스템의 네이티브 이벤트를 사용합니다.


fallbackPolling: 파일 시스템 이벤트를 사용할 때, 이 옵션은 시스템이 네이티브 파일 왓쳐가 부족하거나/혹은 지원하지 않을 때, 사용되는 폴링 전략을 지정합니다. 다음과 같이 설정할 수 있습니다.
fixedPollingInterval: (위를 참조하세요.)
priorityPollingInterval: (위를 참조하세요.)
dynamicPriorityPolling: (위를 참조하세요.)


synchronousWatchDirectory: 디렉터리의 연기된 감시를 비활성화합니다. 연기된 감시는 많은 파일이 한 번에 변경될 때 유용합니다 (예를 들어, npm install을 실행하여 node_modules의 변경), 하지만 덜-일반적인 설정을 위해 비활성화할 수도 있습니다.

